INSERT INTO `beauclasses` VALUES (2,1,'[1st Event] SUMMER EYE POINT MAKE UP','뷰클래스 오픈 1st 이벤트 !!! \r\n\r\n뷰티스타 조 수연님과 함께하는 SUMMER EYE POINT MAKE UP 뷰클래스\r\n\r\n\r\n1교시- 여름마다 번지고, 지워지는 아이라인과 아이섀도우 제대로 그리는 AtoZ 노하우 배우기!!\r\n\r\n2교시- 개인 파우치 체크!!','____.jpg','13:00:00','15:00:00','서울특별시 강남구 역삼1동 616-11‎',10,'2013-06-18 09:29:37','2013-10-22 14:51:02',176,'2013-06-22',0,37.5037,127.028,NULL,'유익한 공간 (신논현역 4번 출구 부근)','개인 파우치(아이라이너&아이섀도우 필수!!)',1,1,'summereye',NULL),(3,5,'내 눈에 어울리는 세미스모키 메이크업','뷰클래스 오픈 기념 뷰클래스 할인 25% ( 50,000 -> 40,000 )\r\n뷰티스타 조 원경님과 함께하는 세미 스모키 메이크업 뷰클래스\r\n1교시- 세미 스모키 메이크업 : 여자들에게 가장 인기 있는 세미 스모키 메이크업, 내 눈에 어울리게 그리는 방법 !!\r\n2교시- 개인 파우치 체크 : \"이 화장품,, 예뻐서 샀는데 저한테 잘 어울리는 건가요? 어떻게 써야할 지 모르겠어요....\"?','320-0.png','19:00:00','21:00:00','서울 강남구 청담동 50-7',6,'2013-06-21 08:28:23','2013-10-21 00:02:52',465,'2013-06-25',40000,37.5233,127.049,NULL,'심플 (청담 사거리 탐앤탐스 뒷편)','체크받고 싶은 내 화장품 파우치',1,1,NULL,NULL),(4,3,'더운 여름 간단히할수 있는 썸머메이크업','[ 7월 1일 월요일밤 12:00 까지 입금하시는 분들께 15,000원!!! (정상가  25,000원에서 40% 할인).\r\n기간 이후, 가격은 조정될 수 있으니 빨리 신청하세요 >.< ]\r\n\r\n뷰티스타 김 다혜님과 함께하는 썸머 메이크업 뷰클래스\r\n\r\n1교시- 더운 여름날 간단히 할수 있는 썸머 메이크업 : 가벼운 베이스 메이크업과 여름철에 더 돋보이는 예쁜 컬러 메이크업\r\n\r\n2교시- 자유로운 Q & A','IMG_2710.JPG','16:00:00','18:00:00','신사동 560 - 16',20,'2013-06-23 08:16:36','2013-10-22 07:28:25',1782,'2013-07-04',15000,37.5199,127.025,NULL,'파티다(신사동 가로수길)','',1,1,NULL,NULL),(5,5,'돋보이는 눈, 세미스모키 메이크업','[본 뷰클래스는 뷰티밋츠의 초대장을 받으신 분들에 한하여 진행될 예정으로, 일반 회원분들의 참여는 아쉽게도 제한됨을 이해해주세요]\r\n\r\n\r\n뷰티스타 조 원경 님과 함께하는 깔끔한 세미 스모키 메이크업\r\n\r\n1교시- 여름철에도 돋보이는 눈, 깔끔한 세미 스모키 메이크업 : 가벼운 베이스 메이크업과 여름철에도 번지지 않는 예쁜 세미 스모키 메이크업\r\n\r\n2교시- 속눈썹 붙이기 실습 클래스 : 속눈썹 반짝반짝, 연예인처럼 연출하고 싶지만 무섭거나 두려웠던 분들을 위한 실습시간\r\n\r\n','eyebrow_4-1.png','19:00:00','21:00:00','강남구 신사동 56-16',15,'2013-06-24 05:09:21','2013-10-22 10:07:36',207,'2013-07-04',NULL,37.5227,127.025,NULL,'비공개 클래스','',1,1,NULL,NULL),(6,6,'반짝반짝 아이 성형 메이크업','내 눈의 단점을 보완하는 반짝반짝 아이 성형 메이크업\r\n\r\n뷰티스타 김 지현님의 \' 매직터치 김슨생, 아이 성형 메이크업 \'\r\n\r\n사람마다 눈 모양이 다른데, 연예인 화장만 따라한다고 되겠어요?\r\n\r\n내 눈의 이쁜 점/부족한 점을 알고, 내 눈이 더 예뻐지는 성형 메이크업에 도전해 보세요! 화장, 절대 어렵지 않아요.','성형메이크업1.jpg','19:00:00','21:00:00','강남구 신사동 542-2',10,'2013-06-24 09:10:13','2014-01-12 06:21:24',1085,'2013-07-10',30000,37.52,127.023,NULL,'카페 레쓰빠쓰(신사동 가로수길)','',3,1,NULL,NULL),(7,1,'기초반#1 -눈썹 다듬기/그리기','메이크업을 어떻게 해야 하는지 도저히 모르시겠다구요?\r\n아주 기초부터 배울 수 있는 뷰클래스가 시작됩니다.\r\n본 기초반 뷰클래스는 약 2시간 30여분 동안 <strong>생생하게 배우고</strong> 실습하면서 메이크업의 기초를 다질 수 있어요. 아름다운 꽃이 가득한 플라워샵에서 이루어지는 뷰클래스 기대해주세요.<br/>\r\n<strong>SCHEDULE></strong>\r\n(본 뷰클래스는 <strong>실습 형태</strong>로 진행됩니다.)\r\n1교시(30분): 눈썹 다듬기에 대한 시연\r\n2교시(100분): 나에게 맞는 눈썹 그리기 실습<br/>\r\n<strong>* 기초반 뷰클래스 이벤트 *</strong>\r\n이벤트 1: 기초반(1)과 기초반(2)를 함께 신청하시는 분들껜 뷰클래스를 10% 할인 !\r\n(총 금액 100,000->90,000)\r\n이벤트 2: 친구와 함께 신청하시는 분들에게도 10% 할인 (총 금액 50,000*2-> 45,000*2)\r\n<span style=\"font-weight:bold; text-decoration:underline\">중복 할인 불가에용 !! >.< </span><br/>\r\n<strong>준비물</strong>\r\n클래스 시작하기 최대 1주일 전부터 눈썹 밀지 말고 오셔야 해요!!\r\n평소에 내가 사용하는 아이브로우 제품 (눈썹 그릴 때 사용하는 화장품)\r\n(클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)\r\n','클래스_사진_7월_27일_1_.jpg','10:30:00','13:00:00','서울특별시 강남구 논현동 246-3',6,'2013-07-17 15:04:50','2014-01-13 03:52:11',800,'2013-07-27',50000,37.515,127.037,NULL,'로즈갤러리(논현동)','클래스 시작하기 최대 1주일 전부터 눈썹 밀지 말고 오셔야 해요!! 평소에 내가 사용하는 아이브로우 제품 (눈썹 그릴 때 사용하는 화장품) (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,NULL,NULL),(8,1,'기초반#2-아이라인+뷰러 사용하기','메이크업을 어떻게 해야 하는지 도저히 모르시겠다구요?\r\n아주 기초부터 배울 수 있는 뷰클래스가 시작됩니다.\r\n본 기초반 뷰클래스는 약 2시간 30여분 동안 <strong>생생하게 배우고</strong> 실습하면서 메이크업의 기초를 다질 수 있어요. 아름다운 꽃이 가득한 플라워샵에서 이루어지는 뷰클래스 기대해주세요.<br/>\r\n<strong>SCHEDULE></strong>\r\n(본 뷰클래스는 <strong>실습 형태</strong>로 진행됩니다.)\r\n1교시 (20분): 기초반(1) 복습 - 눈썹에 대한 클래스\r\n2교시 (30분): 뷰러 사용법 실습\r\n3교시 (90분): 나에게 어울리는 아이라인 찾기<br/>\r\n<strong>* 이런 분들에게 추천드려요 *</strong>\r\n- 점막을 채우라고 하는데 점막이 어디죠? 하시는 분들\r\n- 아이라인 어디서부터 어디까지 그려야 하죠? 하시는 분들\r\n- 뷰러 올리는 것 두려워서 못하겠어요. 하시는 분들<br/>\r\n<strong>* 기초반 뷰클래스 이벤트 *</strong>\r\n이벤트 1: 기초반(1)과 기초반(2)를 함께 신청하시는 분들껜 뷰클래스를 10% 할인 !\r\n(총 금액 100,000->90,000)\r\n이벤트 2: 친구와 함께 신청하시는 분들에게도 10% 할인 (총 금액 50,000*2-> 45,000*2)\r\n<span style=\"font-weight:bold; text-decoration:underline\">중복 할인 불가에용 !! >.< </span><br/>\r\n<strong>준비물</strong>\r\n평소에 내가 사용하는 뷰러, 아이라이너 지참\r\n(클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)\r\n','클래스_사진_8월_3일.jpg','10:30:00','13:00:00','서울특별시 강남구 논현동 246-3',6,'2013-07-17 15:10:33','2014-01-14 06:17:21',500,'2013-08-03',50000,37.515,127.037,NULL,'로즈갤러리(논현동)','평소에 내가 사용하는 뷰러, 아이라이너 지참         (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,NULL,NULL),(9,6,'[남성 글루밍] 내 피부 원래 좋다!','남자들을 위한 글루밍 클래스 1탄!!\r\n피부가 좋은 남자가 되고 싶으신 분들을 위한 클래스 추천하여 드립니다.\r\n본 뷰클래스는 약 2시간동안 <strong>생생하게 배우고 실습하면서</strong> 좋은 피부로 가꿀 수 있도록 도와드립니다. <br/>\r\n<strong>SCHEDULE></strong>\r\n(본 뷰클래스는 <strong>실습형</strong>으로 진행됩니다.)\r\n1교시 (40분): 눈썹 정리\r\n2교시 (80분): 피부표현(썬크림 제대로 바르기+ 잡티 가리기 - BB사용법)<br/>\r\n<strong>* 이런 분들에게 추천드려요 *</strong>\r\n- 얼굴색과 썬크림 색을 맞추기가 힘드신 분들. (썬크림을 바르면 얼굴이 하얘지는 분들.)\r\n- 잘생긴 눈썹을 가지고 싶으신 분들\r\n- 여드름 자국 등의 잡티를 가리고 싶으신 분들\r\n- 가꾸고 멋져지고 싶은데 어디다 물어봐야 할지 도대체 모르는 분들 \r\n- 면접이나 소개팅 등 중요 행사를 앞두신 분들\r\n','클래스용_사진1.jpg','19:00:00','21:00:00','서초구 서초2동 1357-19번지',10,'2013-07-23 10:26:45','2014-01-13 02:17:45',289,'2013-07-31',30000,37.488,127.031,NULL,'뱅뱅사거리 Cafe breath  숨 1979','필기구, 평소에 사용하던 화장품( BB크림, 썬크림등)         (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,NULL,NULL),(10,3,'DAY TO NIGHT MAKE UP','\r\n쌍커풀이 있으신 분들을 위한 변신 뷰클래스를 추천 드립니다. (홑꺼풀이신 분들은 다음 뷰클래스를 기대해 주세요~~ ^^) \r\n본 간단한 아이메이크업으로 청순녀에서 시크녀로 변신 할 수 있는 화장법을 알려드려요.\r\n본 뷰클래스는 약 2시간 동안 <strong생생하게 배우고 ‘실습’ 하면서</strong> 진행될 예정입니다.<br/>\r\n<p><strong>SCHEDULE></strong>\r\n(본 뷰클래스는 실습형 강의 입니다.)\r\n1교시 (20분): Day make-up 시연\r\n2교시 (30분): 실습\r\n휴식시간 (10분)\r\n3교시 (20분): Night make-up 변신 시연\r\n4교시 (30분): 실습 및 Q&A</p>\r\n<p><strong>* 이런 분들에게 추천드려요 *</strong>\r\n- 쌍커풀이 있으신 분들\r\n- 매일 하는 화장이 지겨우신 분들\r\n- 이미지 변화를 느끼고 싶으신 분들\r\n- 평소 김다혜님의 화장법에 궁금증이 많으셨던 분들</p>\r\n<p><strong>* Day to Night Make-up 뷰클래스 이벤트 * </strong>\r\n이벤트: Early Bird 신청 할인 (뷰클래스 신청하시고 <strong>7월 31일까지 입금</strong>하신 분들에 한하여 25,000 원 -> 20,000 원에 할인해 드립니다.) </p>\r\n','day메이크업_다혜1_.jpg','19:00:00','21:00:00','강남구 신사동 560-16',10,'2013-07-29 02:43:12','2014-01-10 12:45:33',896,'2013-08-07',25000,37.5199,127.025,NULL,'가로수길 파티다','필기구, 평소에 사용하던 화장품         (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,NULL,NULL),(11,5,'얼굴도 마음도 아름다워지는 클래스 1','뷰티밋츠와 컬쳐워크(Kulturewalk)가 함께하는 특별한 클래스 1탄!\r\n외면의 뷰티, 메이크업 그리고 내면의 뷰티, 갤러리 투어를 함께 즐길 수 있는 기회!\r\n소중한 친구분들과 함께 <strong>잊었던 소녀 감성을</strong> 다시 느낄 수 있는 시간을 만들어 드리겠습니다.<br/>\r\n<p><strong>SCHEDULE></strong>\r\n1교시 (30분): 동안 메이크업의 특징 시연\r\n2교시 (60분): 동안 메이크업 실습 및 Q&A \r\n\r\n간단한 식사 시간 (뷰티밋츠 제공)\r\n3교시(60분): 북촌 갤러리 투어(컬쳐워크 담당 : 조의주 아트가이드) - 북촌 갤러리 정보는 비밀이에요 :) </p>     \r\n<p><strong>* 이런 분들에게 추천드려요 *</strong>\r\n\r\n- 30~40대 우아한 여성분들\r\n- 동안 메이크업에 대해서 궁금하신 분\r\n- 친구 분들과 특별한 추억을 만들고 싶으신 분들\r\n- 오랫만에 문화생활을 해보고 싶으신 분들\r\n- 이번 여름 휴가를 제대로 다녀오지 못하신 분들\r\n- 그림을 아트 가이드의 전문적인 설명과 함께 느끼고 싶으신 분들\r\n- 특별한 하루를 보내고 싶으신 분 들 \r\n\r\n\r\n\r\n* 위의 갤러리 사진촬영 협조 감사합니다. (작가 : 민준기 / 전시명 : 돌아가는 길)\r\n','0823_3_update.png','11:00:00','14:30:00','서울시 종로구 안국동 175-3',10,'2013-08-04 09:55:37','2014-01-14 20:15:13',337,'2013-08-23',80000,37.576,126.984,NULL,'북촌 카페 해빛(안국역1번출구)','뷰클래스: 필기구, 평소에 사용하는 화장품( 썬크림, BB크림, 아이섀도우, 립스틱 등),  갤러리 투어: 편한 신발과 옷차림 (걸어 다니며 진행되는걸 염두해주세요)',3,1,'',NULL),(12,1,'얼굴도 마음도 아름다워지는 클래스 2','뷰티밋츠와 컬쳐워크(Kulturewalk)가 함께하는 특별한 클래스 2탄! \r\n외면의 뷰티, 메이크업 그리고 내면의 뷰티, 갤러리 투어를 함께 즐길 수 있는 기회! \r\n<strong>예쁘게 활용할 수 있는 가을 메이크업</strong>으로 아름다운 가을을 함께 준비해요.<br/>\r\n<p><strong>SCHEDULE></strong>\r\n1교시 (30분): 가을 메이크업의 특징 시연 \r\n2교시 (60분): 가을 메이크업 실습 및 Q&A\r\n간단한 식사 시간 (뷰티밋츠 제공) \r\n3교시(60분): 북촌 갤러리 투어(컬쳐워크 담당 : 조의주 아트가이드) - 북촌 갤러리 정보는 비밀이에요 :)</p>\r\n<p><strong>* 이런 분들에게 추천드려요 *</strong>\r\n- 20대 나를 가꾸고 싶은 여성분들\r\n- 가을 트렌드 메이크업이 궁금한 분들\r\n- 오랫만에 문화생활을 해보고 싶으신 분들 \r\n- 혼자서는 왠지 취미생활을 즐기기 두려운 분들\r\n- 그림을 아트 가이드의 전문적인 설명과 함께 느끼고 싶으신 분들 \r\n- 도심에서의 특별한 하루를 보내고 싶으신 분들\r\n\r\n*위의 갤러리 사진 촬영 협조 감사합니다. ( 작가 : 민준기 / 전시명 : 돌아가는 길) </p>\r\n','0824_2_update.jpg','11:00:00','14:30:00','서울특별시 종로구 안국동 175-3 ',10,'2013-08-04 10:58:13','2014-01-13 16:05:43',365,'2013-08-24',80000,37.576,126.984,NULL,'북촌 카페 해빛(안국역1번출구)','뷰클래스: 필기구, 평소에 사용하는 화장품(썬크림, BB크림, 아이섀도우, 립스틱 등),  갤러리 투어: 편한 신발과 옷차림 (걸어 다니며 진행되는걸 염두해주세요)',3,1,'',NULL),(13,6,'매직터치 김슨생의 Private 클래스','매직터치 김슨생의 뷰티밋츠 Private 뷰클래스!\r\n평소 김슨생이 전하는 깨알같은 메세지들과 메이크업 팁이 궁금하셨다면 Private 클래스를 신청해보세요.\r\n1:1이 부끄럽다면 친구와 함께(1:2)! \r\n프라이빗 클래스는 뷰티밋츠에서 기획하는 주제가 아닌 여러분들이 직접 뷰티스타에게 묻고 궁금해하는 \r\n메이크업 주제로 1시간 30분~2시간 정도의 시간으로 진행되는 클래스 입니다. \r\n일반 뷰클래스보다 조금더 가격은 비싸지만 그만큼 충분히 뽑고 오실 수 있어요!!','김지현부원장님2_cut_.jpg','16:19:00','16:19:00',' 강남구 청담동 48-1',2,'2013-09-04 16:20:38','2014-01-13 10:35:37',198,'2013-09-04',200000,37.5239,127.048,NULL,'작은차이 현실고','',4,0,'','http://blog.beautymeets.com/60205252960'),(14,5,'뷰티스타 조원경 이사님의 Private 클래스','하나하나 세심하게 가르쳐드리는 뷰티스타 조원경 이사님의 Private 클래스\r\n조수미, 손태연, 윤석화와 같은 정상급 연예인들의 메이크업 아티스트로써 20년이 넘게 활동해온 아티스트로써\r\n누구도 따라올 수 없는 경험과 세심함으로 여러분들의 작은 고민도 확실하게 해결해드립니다. \r\n\r\n프라이빗 클래스는 뷰티밋츠에서 기획하는 주제가 아닌 여러분들이 직접 뷰티스타에게 묻고 궁금해하는 \r\n메이크업 주제로 1시간 30분~2시간 정도의 시간으로 진행되는 클래스 입니다. \r\n일반 뷰클래스보다 조금더 가격은 비싸지만 그만큼 충분히 뽑고 오실 수 있어요!!','private_class_thukb.jpg','16:32:00','16:32:00','서울특별시 강남구 청담동 92-18',NULL,'2013-09-04 16:34:37','2014-01-14 23:16:08',118,'2013-09-04',NULL,37.5243,127.044,NULL,'청담동 엔끌로에','',4,0,'','http://blog.beautymeets.com/60205252960'),(15,1,'뷰티스타 조수연님의 Private 클래스','소규모 뷰클래스의 간판스타, 조수연 선생님의 프라이빗 클래스를 지금 만나보세요. 언제나 밝은 표정과 상세한 설명과 노하우 전수로 배우시는 분들에게 만족도가 높습니다. 얼른 신청하세요!!\r\n\r\n프라이빗 클래스는 뷰티밋츠에서 기획하는 주제가 아닌 여러분들이 직접 뷰티스타에게 묻고 궁금해하는 \r\n메이크업 주제로 1시간 30분~2시간 정도의 시간으로 진행되는 클래스 입니다. \r\n일반 뷰클래스보다 조금더 가격은 비싸지만 그만큼 충분히 뽑고 오실 수 있어요!!','large_0824_2_update.jpg','16:52:00','16:52:00','강남구청역',NULL,'2013-09-04 16:54:37','2014-01-12 23:13:33',119,'2013-09-04',NULL,37.5172,127.041,NULL,'감성메이크업 공간','',4,0,'','http://blog.beautymeets.com/60202517598'),(16,1,'[앵콜] 기초반 - 아이라인+뷰러 사용','지난 여름, 2번이나 조기 마감이 된 \"인기클래스\"가 다시 오픈!\r\n\r\n메이크업을 어떻게 해야 하는지 도저히 모르시겠다구요?\r\n아주 기초부터 배울 수 있는 뷰클래스가 시작됩니다.\r\n본 기초반 뷰클래스는 약<strong> 2시간 30여분</strong> 동안 생생하게 배우고 실습하면서 메이크업의 기초를 다질 수 있어요. <strong>아름다운 꽃이 가득한</strong> 플라워샵에서 이루어지는 뷰클래스 기대해주세요.\r\n<br/>\r\nSCHEDULE>\r\n(본 뷰클래스는 실습 형태로 진행됩니다.)\r\n1교시 (40분): 나에게 어울리는 눈썹 찾기\r\n2교시 (30분): 올바른 뷰러 사용법\r\n쉬는시간 (10분)\r\n3교시 (70분): 나에게 어울리는 아이라인 찾기\r\n<br/>\r\n이런 분들에게 추천드려요 *\r\n점막을 채우라고 하는데 점막이 어디죠? 하시는 분들\r\n아이라인 어디서부터 어디까지 그려야 하죠? 하시는 분들\r\n뷰러 올리는 것 두려워서 못하겠어요. 하시는 분들\r\n쌍커풀이 없는데 저는 아이라인을 어디다 그리죠? 하시는 분들\r\n<br/>\r\n<strong>기초반 뷰클래스 이벤트 </strong>\r\n이벤트 2: 친구와 함께 신청하시는 분들에게 10% 할인 (총 금액 50,000*2-> <strong>45,000*2</strong>)\r\n중복 할인 불가에용 !! >.<','클래스_사진_8월_3일.jpg','13:00:00','15:30:00','서울특별시 강남구 논현동 246-3',6,'2013-09-30 09:18:28','2014-01-14 05:44:01',426,'2013-10-12',50000,37.515,127.037,NULL,'로즈갤러리(논현동)','평소에 내가 사용하는 뷰러, 아이라이너 지참 평소에 내가 그리는대로 눈썹과 아이라인을 그리고 오세요. 잘한점 잘못한점 제대로 코칭해릴수 있도록 ^^  (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,'',NULL),(17,6,'매력어필 데일리 메이크업 클래스','매일 하는 화장이 지겹다구요? \r\n매일 만나는 친구들에게, 직장 동료에게 \r\n\"요새 예.뻐.졌.는.데.?\" \r\n\"화장 잘.한.다.\" 소리 한번 듣고 싶진 않나요?\r\n<p>본 뷰클래스에서는 <strong>약 2시간</strong> 동안 나의 매력을 120% 어필할 수 있는 데일리 메이크업을 생생하게 배우고 실습하도록 할께요.</p>\r\n<p><strong>SCHEDULE> </strong>\r\n(본 뷰클래스는 실습 형태로 진행됩니다.) \r\n1교시(30분): 데일리 메이크업의 기본 강의 \r\n2교시(100분): 나만의 매력을 상승시키는 메이크업 실습</p>\r\n<p>기초반 뷰클래스 이벤트 \r\n이벤트 1: 친구와 함께 신청하시는 분들에게는 10% 할인 (총 금액 50,0002-> 45,000*2) \r\n이벤트 2: 기존에 뷰클래스를 수강한 고객분들에게는10% 할인 \r\n중복 할인 불가에용 !! >.<</p>','jhkim4.jpg','19:00:00','21:00:00','서울시 강남구 청담동 48-1 (루비나빌딩 F4~F5)',5,'2013-10-07 06:03:10','2014-01-14 13:21:10',626,'2013-10-17',50000,37.5239,127.048,NULL,'청담동 작은 차이 현실고','평소에 내가 즐겨하는 메이크업 그대로 하고 오세요!! 평소에 내가 사용하는 화장품 (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,'',NULL),(18,6,'호감가는 첫인상, 면접 메이크업!','면접에서 평가되는 중요한 요소 ‘첫인상’\r\n첫인상에서 좋은 인상을 주는 것이 면접 성공의 첫번째 관문!!\r\n상대방에게 호감도를 높이고, 좋은 점수를 받기위한\r\n나만의 깨끗하고 신뢰감을 줄 수 있는 호감형 첫 인상 만들어 보아요~\r\n\r\n본 뷰클래스에서는 약 2시간 동안 첫인상을 호감으로 만들 수 있는 메이크업을 배웁니다.\r\n<br/>\r\n<strong>스케줄>></strong>\r\n(본 뷰클래스는 강의/시연 + Q&A 형태로 진행됩니다.)\r\n1교시(30분): 면접 메이크업의 기본기 - 깔끔한 피부표현\r\n2교시(100분): 신뢰감을 줄 수 있는 면접 메이크업 시연 및 그동안 궁금했던 면접 메이크업의 Q&A\r\n<br/>\r\n<strong>뷰클래스 면접 성공 기원 이벤트 </strong>\r\n뷰티밋츠에서 모두모두 면접에 성공하시길 기원하며\r\n<strong>50%할인</strong>하여(<strong>15,000원</strong>) 클래스를 진행합니다. 얼른얼른 배우시고 합격하세요!!','면접클래스.jpg','19:00:00','21:00:00','서울시 강남구 역삼동 819-1 강남통일빌딩 2F 에이블스퀘어',20,'2013-10-14 07:58:22','2014-01-14 07:07:35',330,'2013-10-23',15000,37.4992,127.029,NULL,'강남역 에이블스퀘어','본인이 생각하는 면접 메이크업을 하고 오세요~ 평소에 내가 사용하는 화장품 (클렌징, 솜, 거울 등 그 이외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다^^)',3,1,'',NULL),(20,2,'For Beautiful Developers','뷰티 클래스가 뭐하는 곳이냐구요?\r\n매일 화장을 하지 않는다구요?\r\n메이크업은 결혼식때나 받는 것 아니냐구요?\r\n메이크업 아티스트 만나본 적도 없는데 두렵다구요?<br/>\r\n\r\n<p>부담가지지 말고 커피 한잔 마시러 놀러오세요.</p><br/>\r\n\r\n<p>본 뷰클래스에서는 약 90분 동안, 여성 프로그래머 분들만 대상으로 메이크업의 정말 기초부터 우리들의 소소한 뷰티 고민, 이야기를 편하게 나누며 배우는 시간을 가져요.</p>\r\n\r\n<p><strong>SCHEDULE></strong>\r\n(본 뷰클래스는 시연 + Q&A 자유로운 수다 형태로 이루어집니다.)\r\n<strong>1교시(30분)</strong>: 메이크업의 기초 시연\r\n<strong>2교시(60분)</strong>: 메이크업 아티스트와 나누는 우리끼리 뷰티 TALK</p>','Screenshot_2013-10-23_00.08.00.png','19:00:00','20:30:00','서울특별시 강남구 논현로 149길 62 영 B/D 1층',10,'2013-10-22 15:05:54','2013-11-07 03:48:39',53,'2013-10-29',10000,37.5173,127.025,NULL,'신사역 커피휘엘','평소에 내가 하는 메이크업 그대로 하고 오세요 :) 평소에 내가 사용하는 화장품 파우치 (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',1,1,'beautiful',NULL),(21,4,'런치 뷰티 클래스','현대카드 직원들을 대상으로 런치 뷰티 클래스를 진행합니다.','IMG_6555_updated.jpg','12:00:00','13:00:00','서울특별시 영등포구 여의도동 15-21 ‎',40,'2013-10-23 08:54:58','2013-10-23 09:34:47',8,'2013-09-24',NULL,37.5291,126.918,NULL,'현대카드 본사','',1,1,'hyundai',NULL),(22,4,'런치 뷰티 클래스 episode2','현대카드 직원들을 대상으로 Lip 메이크업 클래스를 진행하였습니다.','_1020911_updated.jpg','12:00:00','13:00:00','서울특별시 영등포구 여의도동 15-21 ‎',41,'2013-10-23 09:32:31','2013-10-23 09:32:48',2,'2013-10-15',NULL,37.5291,126.918,NULL,'현대카드 본사 ','',1,1,'hyundai',NULL),(23,6,'첫인상을 바꿔보자, 호감형 메이크업!','사람을 만날 때 그 사람을 판단하는 시간 \"3초\"\r\n그 \"3초\"에 나를 매력적인 사람으로 보이게 하는 메이크업입니다:)\r\n첫인상을 호감으로 상대방으로 하여금 좋은 평가를 얻어낼 수 있는 노하우 ! 알려드립니다.\r\n면접, 소개팅,상견례등 처음 만나는 자리에서 중요하게 쓰일 메이크업 방법입니다.\r\n본 뷰클래스에서는 약 2시간 동안 첫인상을 호감으로 만들 수 있는 메이크업을 배웁니다.\r\n\r\n스케줄\r\n(본 뷰클래스는 강의/시연 + Q&A 형태로 진행됩니다.)\r\n호감형 메이크업의 기본기 - 깔끔한 피부표현을 포함한 메이크업 시연\r\n2교시(100분) : 그동안 궁금했던 나의 뷰티고민 해결시간, 메이크업 노하우 Q&A + 개인별 컨설팅','부원장님.jpg','19:00:00','21:00:00','서울 강남구 논현동 118-20번지 1층',10,'2013-10-24 04:30:29','2014-01-14 17:47:02',535,'2013-11-07',30000,37.5173,127.039,NULL,'논현동 강남구청역 부근 (장소 업데이트 후 공지)','본인이 평소에 중요한 사람을 만날 때 했던 메이크업 평소에 내가 사용하는 화장품 (클렌징, 솜, 거울 등 그 이외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다^^)',3,1,'',NULL),(24,1,' 30만명이 수강한 고준희 st. 음영 메이크업','음영 메이크업!+.+\r\n\r\n이제 쌀쌀해지는 늦 가을인데 아직도 핑크색 섀도우 바르고 다니시는 분!, 아직도 파란색 섀도우 바르고 다니시는 분!\r\n이제! 은은한 분위기의 가을 여자로 다시 태어나세요~\r\n약 30만명이 영상으로 수강한 조수연님의 음영 메이크업 뷰토리얼을 오프라인 강의로 배우실 수 있어요~\r\n영상에서 어려웠던 부분, 정말로 가능한 걸까?\r\n내 눈에도 정말로 될까? 궁금했던 분들!!\r\n꼭 오셔서 눈으로 확인하세요~\r\n모두들 분위기 있는 여성 분들로 거듭나실 거에요~\r\n\r\n\r\n뷰클래스 이벤트 (~11/3)\r\n이벤트 1: 친구와 함께 신청하시는 분들에게는 10% 할인 (총 금액 50,0002-> 45,000*2) \r\n이벤트 2: 기존에 뷰클래스를 수강한 고객분들에게는10% 할인 \r\n중복 할인 불가에용 !! >.<','조수연님_cut.jpg','13:00:00','15:00:00','서울특별시 강남구 논현동 246-3',5,'2013-10-25 12:33:42','2014-01-14 18:00:15',788,'2013-11-09',50000,37.515,127.037,NULL,'로즈갤러리(논현동)','평소에 내가 사용하는 제품들을 가지고 오세요  (클렌징, 솜, 거울 등 그 외 필요한 제품은 뷰티밋츠에서 제공하여 드립니다. ^^)',3,1,'',NULL),(25,2,'뷰티스타 이다영님의 Private 클래스','이다영 선생님의 프라이빗 클래스를 지금 만나보세요. 상냥하게 하나하나 꼼꼼히 전해주시는 상세한 설명과 노하우를 전수해 드려요.\r\n\r\n프라이빗 클래스는 뷰티밋츠에서 기획하는 주제가 아닌 여러분들이 직접 뷰티스타에게 묻고 궁금해하는 \r\n메이크업 주제로 1시간 30분~2시간 정도의 시간으로 진행되는 클래스 입니다. \r\n일반 뷰클래스보다 조금더 가격은 비싸지만 그만큼 충분히 뽑고 오실 수 있어요!!','large_Screenshot_2013-10-23_00.08.00.png','02:08:00','02:08:00','미정',NULL,'2013-10-31 02:13:23','2014-01-12 03:00:41',79,'2013-10-31',NULL,36.551,126.634,NULL,'미정','',4,0,'',NULL);
