INSERT INTO `beautorial_steps` VALUES (1,1,'입술 정리','- 메이크업을 시작하기전 립밤을 발라 입술을 촉촉하게 만들어줍니다.','2013-06-07 17:04:08','2013-06-08 13:02:55'),(2,1,'얼굴에 수분감 더해주기','- 모이스춰라이저를 소량만 얼굴에 발라줍니다. \r\n- 파운데이션 브러쉬를 사용하면 커버력을 높일 수 있어요.\r\n- 눈, 코, 볼, 이마, 턱등 전체적으로 모두 발라주세요.\r\n- 코, 볼 주변, 인중, 눈 앞머리 주변구석구석 발라서 피부톤을 일정하게 맞추어 줍니다.\r\n','2013-06-07 17:04:28','2013-06-08 13:03:48'),(3,1,'눈주변 커버 및 정리','- 컨실러를 눈가 다크서클 부분에 발라줍니다. 네번째 손가락을 사용해서 약하게 블렌딩해주세요\r\n- 이후 컨실러의 경계선을 파운데이션 브러쉬를 사용하여 펴주세요.','2013-06-07 17:04:58','2013-06-08 13:04:01'),(4,1,'얼굴에 생기 더하기','- 멀티스틱을 광대뼈 아래부분과 턱부분에 발라주세요.\r\n- 풀커리지 브러쉬를 이용해서 블렌딩해주세요.\r\n- 헤어라인에도 발라주고 브러쉬로 펴주세요.','2013-06-07 17:05:15','2013-06-08 13:04:15'),(5,1,'피부 잡티 커버하기','- 컨실러와 컨실러 브러쉬를 이용하여 얼굴에 잡티를 커버해주세요.\r\n- 컨실러 브러쉬에 소량만 묻혀 점을 찍듯이 가려주시면 되요','2013-06-07 17:05:42','2013-06-08 13:04:27'),(6,1,'눈썹 기초','- 브로우 펜슬을 사용해서 눈썹에 빈부분을 채우듯 그려주세요\r\n- 라인을 따서 그리면 눈썹이 촌스러워보이니 빈부분만 채우는 식으로 그려주세요\r\n- 스크류브러쉬를 사용하여 눈썹에 그린 부분을 자연스럽게 블렌딩시켜주세요.','2013-06-07 17:06:00','2013-06-08 13:04:41'),(7,1,'눈주변을 환하게 만들기','- 샴페인 커츠 색상의 아이쉐도우를 아이스윗브러쉬에 묻혀서 눈두덩이 전체에 넓게 발라줍니다.\r\n- 같은 색상을 총알 브러쉬에 묻혀서 눈 앞머리와 언더에도 발라줍니다.\r\n- 아이쉐도우를 조금 작은 브러쉬에 묻혀 눈 끝부분에 음영을 넣어줍니다.\r\n- 경계선이 생기지 않도록 자연스럽게 블랜딩 해주세요.\r\n','2013-06-07 17:06:21','2013-06-08 13:05:03'),(8,1,'아이라인 그리기','- 블랙잉크 색상의 젤 아이라이너를 사용하여 브러쉬에 소량만 묻혀 속눈썹 사이 점막을 채우듯이 그려주세요.\r\n- 눈꼬리는 살짝만 빼주세요.','2013-06-08 00:26:54','2013-06-08 13:05:16'),(9,1,'속눈썹 풍성하게 만들기','- 평평한 부분과 둥근 모양의 솔을 가지고 있는 마스카라를 사용, 속눈썹을 풍성하게 만들어주세요.\r\n- 평편한 면을 사용하여 속눈썹을 길게 만들어주시고 둥근면일 이용하여 볼륨감을 더해주세요.','2013-06-08 00:28:10','2013-06-08 13:05:32'),(10,1,'입술 주변 정리하기','- 컨실러를 사용해서 입술색상을 다운시켜 주세요. 소량만 사용하여 입술라인만 덮어주듯이 발라주시면 됩니다.','2013-06-08 00:29:20','2013-06-08 13:05:58'),(11,1,'원 포인트 푸시아 핑크 바르기','- 오늘의 원 포인트, 비비드한 푸시아 핑크 색상의 립펜슬로 입술라인을 만들고 입술전체에 가볍게 발라주세요.\r\n- 매트한 느낌의 하트색상 립컬러를 입술전체에 발라주세요.\r\n- 립브러쉬를 사용해서 입술라인을 깔끔하게 정리해주세요. \r\n- 티슈를 사용하여 립스틱의 양을 조절해주세요.','2013-06-08 00:29:58','2013-06-08 13:03:26'),(12,1,'입술라인 한번 더 정리하기','- 컨실러를 컨실러 브러쉬에 묻혀 입술라인을 한번 더 정리해주세요.','2013-06-08 00:32:05','2013-06-08 13:03:05'),(13,2,'피부결 정리하기','- 스킨을 이용하여 피부결을 정돈합니다.  \r\n- 스킨은 수분공급을 해주고, 피부에 남아있는 잔여물을 깨끗히 정리해줍니다.','2013-06-08 00:40:31','2013-06-08 13:00:35'),(14,2,'피부에 수분공급하기','- 젤타입의 수분로션을 이용하여 한번 더 피부에 수분공급을 해줍니다.\r\n- 꼼꼼히  얼굴 구석구석 발라줍니다. ','2013-06-08 00:41:08','2013-06-08 13:00:50'),(15,2,'피부 모공 가리기','- 모공 프라이머를 사용하여 모공을 가려줍니다.\r\n- 프라이머의 양이 많을 경우, 베이스가 밀릴 수 있기 때문에 소량만 이용하여 모공을 메꾸어 줍니다. ','2013-06-08 00:42:05','2013-06-08 13:01:03'),(16,2,'하이라이트 주기','- 안색 크림을 이용하여 얼굴에 하이라이트 효과를 줍니다.\r\n- 하이라이트를 주고 싶은 부분에만 톡톡 발라줍니다.\r\n- 하이라이트는 주로 T존, 눈밑, 눈두덩이, 인중에 주는데, 얼굴형이 긴 분들은 턱 부분을 생략해주세요.','2013-06-08 00:43:16','2013-06-08 13:01:19'),(17,2,'베이스 바르기','- 피부결에 따라, 얇게 발리는 장점을 가진 브러쉬를 이용하여 베이스를 바릅니다. 붓자국이 남는 경우에는 손을 이용하여 두드려주면 됩니다.\r\n- 이때, 얇게 여러번 바르는 것이 포인트이며, 두껍게 바를 경우에는 나중에 화장이 뜨거나 밀릴 수 있으니 주의해주세요.\r\n- 스폰지의 뾰족한 부분을 이용하여, 눈주위(눈밑, 눈꼬리, 콧볼의 구석 구석에 베이스를 발라줍니다.\r\n- 커버하고 싶은 부위는 \'적은양으로 여러번 바르는 것\'이 베이스의 커버력과 밀착력을 높이는 포인트입니다.\r\n- 브러시가 없는 분들은 손의 따뜻한 온기를 이용하여 발라주시면, 밀착력을 더욱 높일 수 있습니다. ','2013-06-08 00:45:39','2013-06-08 13:01:50'),(18,2,'컨실러 바르기','- 크림 타입의 컨실러는 바로 피부에 바르지 말고, 브러시나 손에 묻힌 다음 손등에서 적당량을 조절하고 난 뒤 발라주세요.\r\n- 눈밑, 팔자 주름 등 피부가 얇고 주름이 많은 부분엔 많은 양을 바르면 시간이 지나면  도드라질 수 있으니, 최대한 얇게 발라주는 것이 좋습니다.\r\n- 펜슬타입의 컨실러는 흉터나 점등을 간편하게 커버할 수 있습니다. 최대한 티가 나지 않게 얇게 펴발라 주는 것이 포인트 입니다. ','2013-06-08 00:47:01','2013-06-08 13:02:05'),(19,2,'가루 파우더 바르기','- 가루 파우더를 이용하여, 얼굴 외곽 부분에 조금씩 살살 눌려주며 발라주세요.. \r\n- 파운데이션보다 파우더량이 많을 경우, 피부가 답답해보일 수 있으므로 최소한의 양만 사용하는 것이 좋습니다. \r\n- 파우더를 이용하여 뽀송함을 강조하는 것 보다 피부를 윤기있게 하면 요새 유행하는 윤광메이크업을 할 수 있습니다. ','2013-06-08 00:48:27','2013-06-08 13:02:20'),(20,2,'쉐딩 주기','- 조금 어두운 컬러의 파우더를 큰 브러쉬를 이용하여 얼굴 외곽 부근에 둘러주듯이 발라줍니다.\r\n- 파우더를을 브러쉬에 묻혀, 바로 사용하지 않고 꼭  털어서 사용하는 것이 쉐딩을 덜 뭉치게 하고 자연스럽게 할 수 있습니다.','2013-06-08 00:50:02','2013-06-08 13:02:35'),(21,3,'세안','- 세안을 할때 모공이 커지지 않게 살살해주세요.\r\n- 클렌징 티슈로 피부에 자극을 많이 주면 모공이 늘어나면서 홍조가 생기고, 쌍꺼풀도 쳐져요. 티슈만 쓰지 않아도 피부가 좋아져요.\r\n- 세안할때도 손을 너무 박박문지르듯 하지말고 가볍게 닦아주듯이 세안하세요. 클렌징 티슈는 사용금지!!\r\n- 스크럽은 코정도만 살살 바르시고 볼주변은 사용하지 마세요. 안그러면 완전 빨개져요!!\r\n- 각질은 그냥 저절로 떨어지도록 그냥 두는게 좋아요. 피부는 건강하게 재생이 되도록 도와주세요. \r\n- 피부가 건조하다고 스킨관련제품을 많이 바르고 파운데이션을 바르면 각질처럼 보이니 스킨로션만 간단히 바르고 메이크업에 들어가세요.','2013-06-15 01:31:56','2013-06-15 01:31:56'),(22,3,'베이스','- 얼굴이 건조한 사람들은 광택감이 높은 수분 젤, 또는 크림타입의 수분베이스를 이마, 코, 볼 주변에 로션바르듯 발라주세요. \r\n- 아침에 스킨, 로션만 바른후 유분기가 살짝 돌정도만 베이스를 해주고 파운데이션을 필요한 부분만 해주시면 됩니다.\r\n- 전체적으로 베이스를 하면 메이크업이 두껍고 밀려보이며 피부가 건조해보여요.','2013-06-15 01:34:38','2013-06-15 01:34:38'),(23,4,'파운데이션','- 광택감있는 피부를 표현한 뒤, 파운데이션은 살짝 발라주세요. 얼굴 전체 면적보다는 광대뼈 부위, 코주위, 이마에만!!\r\n- 파운데이션 전용 브러쉬가 없다면 미술용 브러쉬도 활용할 수 있어요. 좀더 가볍게 바를 수 있는 장점이 있답니다.\r\n- 오일프리 타입의 파운데이션을 살짝 덜어서, 붉은기가 있는 부분에 발라주고 수분 라텍스에 두들겨서 수분감을 더해주세요.\r\n- 파우더를 하게 되면 나중에 메이크업을 수정하기가 어렵고, 밀릴 수 있으니 꼭 필요한 부분에만 발라주세요.\r\n- 오일프리 타입 파운데이션은 가급적 손보다는 브러쉬를 이욯하고 수분라텍스나 스펀지로 마무리해주세요.\r\n- 파운데이션은 한꺼번에 많이 바르지말고 조금씩 필요한 곳에만...수분라텍스로 절대 밀면서 바지말고 두드려서 발라주세요.\r\n- 얼굴의 붉은 기만 커버되더라도 얼굴형이 잡히고 예뻐보여요. 화장 안한듯 예뻐보이기 위해선 가벼운 피부표현이 핵심!!','2013-06-15 01:45:11','2013-06-15 01:45:11'),(24,4,'파우더','- 파우더는 기본적으로 화장을 날라가게 하는 유분을 커버해줄 부분만!! 눈 두덩이, 눈밑, 눈썹 주변에 톡톡톡!!\r\n- 팩트를 사용해서 파우더를 바르면 얼굴이 더 뜨고 피부표현이 힘들어요.ㅠ\r\n- 유분감을 살짝 파우더로만 커버하고, 색조화장을 가볍게 해주는 것이 여름에 더욱 생기있는 메이크업을 연출할 수 있어요. \r\n- 화장이 잘 번지는 부분(눈두덩이, 눈 꼬리주위, 눈썹 주변등)에 가볍게 파우더를 발라주어 마스카라등이 번지는 것을 막아주세요.\r\n- 조금 어두운 파우더를 얼굴 주위로 두들겨주면 쉐딩효과 만점!! 얼굴이 깔끔해보이고, 작아보이는 효과를 줄 수 있어요.\r\n- 수정 메이크업엔 들뜰수 있는 파우더 대신 펜슬타입의 컨실러로 유분기 있고 붉은 부분ㅇ만 커버해주면 간편해요.','2013-06-15 01:55:38','2013-06-15 01:55:38'),(25,4,'볼터치','- 브러쉬를 어떻게 쓰냐에 따라서 볼터치의 농도가 틀려져요.\r\n- 빨개지는 블려서, 올바른 브러쉬 사용방법이 중요해요. 체크!!\r\n- 브러쉬를 지나치게 꺾으면 볼터치가 진해질 수 밖에 없어요. 가볍게 볼에 살짝 스치는 느낌으로 은은하게 터치해주세요.\r\n- 블러셔를 묻힌 브러쉬는 그대로 바르지 말고 한번 반드서 털어 살짝 가볍게 걷도는 듯이 볼륨을 살려주고 싶은 부분에 해주세요. \r\n- 손목에 힘을 빼고 볼을 스치듯이, 절대로 붓을 꺾지말고 겉에만 살짝해주세요. 모두 연습!!','2013-06-15 01:58:10','2013-06-15 01:58:10'),(26,6,'EYE 피부톤 정리하기','- 컨실러를 이용하여 눈두덩이의 피부톤을 정리해주세요.','2013-06-17 02:38:55','2013-06-17 02:39:20'),(27,6,'아이섀도우 바르기1','- 피부톤보다 한톤정도 어두운 섀도우를 눈두덩이와 노즈부분에 넓게 발라주세요.\r\n- 섀도우는 펄이 없는 제품으로 선택!! 펄이 강할경우 자칫 눈이 부어보일 수 있으니 주의하세요.\r\n- 면봉으로 그라데이션 해주세요. \r\n','2013-06-17 02:43:26','2013-06-17 02:44:02'),(28,6,'아이섀도우 바르기2','- 브라운 섀도우를 쌍커풀 라인을 조금 넘어가도록 발라주세요.\r\n- 쌍꺼풀이 없으신 분들은 거울을 정면으로 봤을때 섀도우컬러가 보이는 정도로 발라주시면 됩니다.\r\n- 면봉으로 그라데이션 해주세요.','2013-06-17 02:43:49','2013-06-17 02:43:49'),(29,6,'아이섀도우 바르기3','- 펄이 없는 아주 진한 브라운 섀도우를 눈꼬리 부분에 아이라인 그리듯 발라줍니다.\r\n- 면봉으로 그라데이션 해주세요.  ','2013-06-17 02:44:36','2013-06-17 02:44:36'),(30,6,'점막 채우기','- 브라운 젤 아이라이너를 이용해 점막부분을 꼼꼼히 채워줍니다. 펜슬타입의 아이라이너를 써도 좋아요.\r\n- 아이라인 브러쉬에 브라운 섀도우를 묻혀 점막부분을 채운부분에 꾹꾹눌르듯 발라주세요. 아이라인의 번짐을 방지해줍니다.\r\n- 브러쉬에 이미 묻어져 있는 라인만을 이용해 눈언더라인의 점막을 칠해주세요.\r\n- 꼬리부분부터 시작해 눈 1/3지점까지 발라주세요.\r\n- 아이라인 브러쉬 브라운 섀도우를 묻힌 후, 라인이 올라간 점막부분을 한번 더 발라주세요.\r\n- 면봉으로 그라데이션 해주세요.','2013-06-17 02:47:08','2013-06-17 02:47:28'),(31,6,'눈 앞머리 다듬기','- 눈 앞머리에 포인트 브러쉬를 이용하여 약간의 펄이 함유된 골드컬러를 발라주세요.\r\n- 면봉으로 그라데이션 해주세요. ','2013-06-17 02:47:52','2013-06-17 02:48:29'),(32,6,'속눈썹 올리기','- 뷰러로 눈썹을 올려줍니다. 중앙-눈 앞머리-꼬리부분, 삼등분 하여 올려주세요.\r\n- 속눈썹이 뭉치지 않게 손가락으로 펴주세요.\r\n- 블랙 마스카라를 눈썹의 뿌리를 중심으로 튕기듯 올려줍니다.\r\n- 언더라인에도 마스카라를 발라주세요. 뭉침이 생기지 않도록 마스카라 입구에 양조절을 충분히 한 후 발라주세요.','2013-06-17 02:50:19','2013-06-17 02:50:19'),(33,6,'보너스!! 고준희 입술 만들기','- 오렌지 컬러 립스틱을 입술전체에 톡톡 두드려 바른 후, 손가락으로 툭툭 두드리며 펴발라 주세요.\r\n- 진한 오렌지 컬러 립스틱을 입술안쪽에만 톡톡 바른후 바깥 방향으로 펴주듯 발라주세요.\r\n- 손가락으로 펴주셔도 좋아요. ','2013-06-17 02:52:00','2013-06-17 02:52:00'),(34,7,'베이스','- 베이스 메이크업 전, 미스트를 얼굴 전체적으로 뿌린 후 톡톡 두드리며 적당히 흡수시켜 주세요','2013-06-18 15:56:31','2013-06-18 15:56:31'),(35,7,'베이스','- 수분에센스를 피부결을 따라 브러쉬를 이용하여 발라주세요','2013-06-18 15:56:47','2013-06-18 15:56:47'),(36,7,'베이스','- 톤보정을 위해 컬러베이스를 수분에센스와 1:1로 믹스하여, 브러쉬를 이용하여 발라주세요. (베이스 컬러 선택 Tip : 붉은기 보정 - 그린 컬러, 노란 피부 보정 - 핑크 컬러, 어두운 피부 보정 - 퍼플 컬러)','2013-06-18 15:56:57','2013-06-18 15:56:57'),(37,7,'베이스','- 수분에센스와 묽은 타입의 파운데이션을 1:1로 섞어서 브러시를 사용하여 발라주세요. 커버를 원하는 부분이 있다면, 한번 더 덧발라주세요','2013-06-18 15:57:09','2013-06-18 15:57:09'),(38,7,'EYE','- 원하는 컬러의 섀도우를 긁어내어 가루타입으로 만든 후,  수분에센스와 믹스하여 컨실러 브러쉬를 사용하여 눈두덩이에 발라주세요','2013-06-18 15:57:27','2013-06-18 15:57:27'),(39,7,'블러셔','- 립스틱을 손가락에 묻혀 블러셔 부분에 톡톡 두드린 후 브러쉬로 자연스러운 그라데이션을 해주세요','2013-06-18 15:57:44','2013-06-18 15:58:15'),(40,7,'블러셔','- 하이라이터를 긁어내어 가루타입으로 만든 후 수분 에센스와 믹스하여 얼굴에 환해보이고 싶은 눈및, 광대, 팔자 주름을 따라 브러쉬를 이용하여 발라주세요','2013-06-18 15:58:28','2013-06-18 15:58:28'),(41,7,'입술','-  립스틱을 입술 안쪽에 톡톡 두드리며 발라주세요. 투명한 립글로스로 마무리하여 촉촉한 입술을 표현해 주세요','2013-06-18 15:58:40','2013-06-18 15:58:40'),(42,7,'미스트','- 마지막으로 전체적으로 수분 미스트를 뿌려 촉촉한 물광느낌을 더욱 살려주세요','2013-06-18 15:59:04','2013-06-18 15:59:04'),(43,8,'볼터치 방법','- 요즘 유행하는 볼터치 방법은 애플존 부분에만 가볍게 하는 것이에요','2013-06-20 09:03:53','2013-06-20 09:04:32'),(44,8,'컬러','- 피부톤이 어두운 분들, 브론즈 컬러 메이크업, 여름철 태닝한 피부에 살구빛, 코럴빛의 블러셔를 사용하는 것이 가장 윤기있고 자연스러워요 \r\n- 우리나라 여성분들처럼 노란빛 피부(웜톤 피부)에는 진한 오렌지 컬러보다는 피치 컬러가 자연스럽고 무난하게 잘 어울려요.','2013-06-20 09:04:24','2013-06-20 09:04:24'),(45,8,'- 제품 선택시 주의사항','펄이 크고 많은 제품 보다는 미세한 펄 입자의 블러셔를 고르는 것이 피부를 깨끗하게 보이게 해요','2013-06-20 09:04:50','2013-06-20 09:04:50'),(46,10,'섀도우','- 스크류 브러쉬로 눈썹을 빗어주고, 섀도우를 이용하여 그리고 싶은 눈썹 모양으로 틀을 그리기 시작해요. \r\n- 눈썹 모양이 잘 다듬어져 있는 분들, 숱이 많은 분들은 펜슬을 사용하지 않고 섀도우로만 그리시는 것이 자연스러워요','2013-06-23 14:47:17','2013-06-23 14:47:17'),(47,10,'브러쉬 ','- 사선 브러쉬를 이용해서 눈썹에서 코 부분을 연결시켜주시면, 콧대가 솟은 효과를 나타내실 수 있어요. 진하게 하지 않는 것이 포인트!!!','2013-06-23 14:48:46','2013-06-23 14:48:46'),(48,10,'파우더','- 밝은톤의 파우더를 눈썹뼈와 눈두덩이에 펴발라주세요. 섀도우의 발색을 훨씬 더 이쁘게 나타내기 위해서에요','2013-06-23 14:50:08','2013-06-23 14:50:08'),(49,10,'섀도우','- 크림타입의 섀도우를 톡톡 두드리며 발라주면, 잘 지워지지 않고 지속력 높은 눈화장을 하실 수 있어요.','2013-06-23 14:50:42','2013-06-23 14:50:42'),(50,10,'아이라이너','- 초보자 분들은 펜슬타입의 아이라이너를 사용하시는 것이 가장 쉽게 그리실 수 있어요. 아이라인의 효과를 크게 하기 위해서는 반드시 꼭 점막을 채워야 하는 점 잊지마세요.','2013-06-23 14:51:34','2013-06-23 14:51:34'),(51,10,'섀도우','- 아이라인이 번지는 것을 막기 위해, 어두운 색 섀도우로 아이라인을 그린 윗부분에 다시 한번 그려주세요.','2013-06-23 14:52:47','2013-06-23 14:52:47'),(52,10,'섀도우','- 아이라인보다 조금 밝은 브라운 섀도우로 아이라인 윗부분으로 그라데이션을 해주세요. ','2013-06-23 14:53:37','2013-06-23 14:53:37'),(53,10,'섀도우','- 밝은 골드 베이지 컬러를 크림 섀도우를 발랐던 부분과 언더라인에 발라주세요.','2013-06-23 14:54:46','2013-06-23 14:54:46'),(54,10,'섀도우','- 글리터가 조금 큰 섀도우를 눈두덩이의 중간부분에 바르면 볼륨감있는 눈매를 그릴수가 있는데, 글리터는 가루날림이 심하기 때문에 브러쉬를 사용하지 말고 손으로 두드려 발라주세요.  ','2013-06-23 14:55:14','2013-06-23 14:55:14'),(55,10,'속눈썹','- 뷰러를 이용해서 눈썹을 올릴때는, 한번에 욕심내지 말고 세 번에 나누어서 올리는 것이 활모양으로 예쁘게 올릴 수 있는 방법이에요.\r\n- 마스카라는 반드시 입구에서 양조절을 해서 발라야 잘 뭉치지 않고 바를 수 있어요. 사용시에 펌핑을 많이 하면, 유통기한보다 쉽게 굳을 수 있기 때문에 주의해주세요.','2013-06-23 14:57:46','2013-06-23 14:57:46'),(56,10,'아이라이너','- 언더라인을 그리시고 싶은 분들은  점막에만 살짝 그려주세요. 역시, 섀도우를 한번 덧발라 그려주셔야 번짐을 막으실 수 있어요. \r\n- 눈밑에 크림색 섀도우를 한번 발라주시면 눈 밑이 통통해 보이고 어려보이는 효과를 연출 하실 수 있어요. 	','2013-06-23 14:59:08','2013-06-23 14:59:08'),(57,10,'립스틱(Lip)','- 핑크베이지 컬러의 립스틱을 입술 안쪽부터 메꾸듯이 발라주세요. 라인을 또렷하게 그리면 나이가 들어 보일수 있으니 주의해주세요.','2013-06-23 14:59:40','2013-06-23 14:59:40'),(58,10,'립글로스(Lip)','- 립스틱 컬러와 비슷한 컬러의 립글로스를 사용해서 립스틱 바른 위에 살짝 얹어주세요. 볼륨감 있는 입술을 연출 하실 수 있어요.\r\n- 입술이 두꺼우신 분들은 립글로스를 전체적으로 바르지 말고 안쪽에만 발라주세요.','2013-06-23 15:00:29','2013-06-23 15:00:29'),(59,12,'눈썹','- 모발색깔에 맞게 브로우칼라를 선택해서 빗어주세요. \r\n- 비어있는 곳에만 아이브로우 섀도우로 채워주세요.\r\n- 브러쉬를 이용하여 그린 눈썹을 채워주세요.\r\n- 눈앞머리까지 눈썹을 정리하면 나이들어보이니 조심조심!\r\n- 스크류 브러쉬로 빗어주며 마무리해주세요.\r\n','2013-07-19 08:27:47','2013-07-19 08:29:28'),(60,12,'속눈썹','- 뷰러는 손목에 힘을 빼고 느슨하게 빼면서 여러번 당겨주세요.\r\n- 속눈썹은 눈 앞머리와 꼬리부분을 나누어 뷰러를 하면 좀더 편하게 할 수 있어요.\r\n- 뷰러를 먼저하고 메이크업을 하면 눈꺼풀이 올라가서 좀더 편하게 메이크업을 할 수 있어요.\r\n- 섀도우를 하고 뷰러를 하면 섀도우가 뭉게질 수도 있어요.ㅠ','2013-07-19 08:31:18','2013-07-19 08:31:18'),(61,12,'아이섀도우','- 쌍커풀 라인 위로 들어갔다가 위쪽으로 빼는 느낌으로 가볍게 2,3번 발라주세요.\r\n- 아이섀도우가 많이 번지는 경우, 조금 더 진한 브라운 섀도우를 사용하여 눈매의 발색이 제일 진해지는 눈꼬리 부분을 여러번 발라주세요.','2013-07-19 08:32:51','2013-07-19 08:32:51'),(62,13,'아이라인','- 눈동자가 보이는 가운데에 펜슬로 점막을 칠해주세요. \r\n- 써클 EYE 메이크업 뷰토리얼에서 상세하게 알 수 있어요!\r\n- 블랙 아이라이너로 속눈썹 사이사이를 메꾸며 라인을 만들어주세요.\r\n- 눈동자 주변 아래만 펜슬을 칠하면 많이 번지지 않으면서도 또렷한 눈매를 연출할 수 있어요.','2013-07-19 08:35:07','2013-07-19 08:35:07'),(63,13,'속눈썹','- 마스카라를 눈썹 전체가 아닌 부분부분 들어올리는 것처럼 발라주세요. 좀더 풍성하면서도 속눈썹이 길어보이게 할 수 있어요.\r\n- 눈주변에 떨어진 마스카라는 면봉으로 살짝 닦아주시는 센스\r\n- 아랫쪽도 마스카라를 발라줍니다. 마스카라를 살짝 세워서 빗어주듯이 발라주세요.\r\n- 광택이 약간 감도는 아이섀도우를 사용하여 애교살에 발라줍니다. 웃으면 튀어나오는 부분이 \'애교살\'이에요.\r\n','2013-07-19 08:38:24','2013-07-19 08:38:24'),(64,13,'입술(보너스)','- 도톰한 입술에는 가볍게 틴트만 발라서 입술을 살짝 혈색있어보이게 해주고, 립밤으로 마무리해줍니다. \r\n- 입술에 침을 많이 바르면 주름이 많이 생기게 되요. \r\n- 입술라인을 투명하게 하고 싶을 경우는, 파운데이션으로 입술 외관을 스폰지로 두드려주고 중앙에 립스틱으로 마무리해주세요. ','2013-07-19 08:41:06','2013-07-19 08:41:06'),(65,15,'아이섀도우','- 펜슬 타입의 섀도우를 사용하여 전체적으로 눈두덩이에 펴발라주세요.\r\n- <strong>펜슬</strong> 타입은 크림타입의 섀도우와 비슷한 편인데 발색도 훨씬 잘되고 지속력이 좋아요.','2013-08-01 02:25:59','2013-08-01 02:25:59'),(66,15,'아이섀도우','- 조금 더 밝은 <strong>크림</strong> 섀도우를 덧발라 그라데이션 해주세요.\r\n- 섀도우중에 펄이 많은 것도 있고 적은 것도 있어요. 펄 입자가 잔잔한 것이 베이스로 깔면 눈매를 더 곱게 살려줄 수 있어요. 펄 입자가 없는 경우는 초보가 쓰기에는 조금 어려워요','2013-08-01 02:27:06','2013-08-01 02:27:06'),(67,15,'아이라인','-  젤 아이라이너로 아이라인을 그려줍니다. 속눈썹 사이사이 점막을 채워주시고, 세미스모키에 어울리게 조금더 두껍게 그려주세요.\r\n- 전체적으로 쌍꺼풀라인을 다채운다고 생각하시고 라인 끝은 3,4mm 정도 더 빼주시면 됩니다.','2013-08-01 02:27:31','2013-08-01 02:28:02'),(68,15,'아이라인','- 리퀴드 타입의 아이라이너를 통해 한번더 그려줍니다. 리퀴드타입은 색깔표현이 좋고 잘 지워지지 않아요.\r\n- 아이라이너에 있는 브러쉬는 조금 긴편이라 조금 불편한 분들은 손에 익은 기존 브러쉬를 사용하는 것이 좋아요.','2013-08-01 02:28:42','2013-08-01 02:28:42'),(69,15,'아이라인','- 검은색 아이섀도우를 이용해서 아이라이너를 그린 위에 덮어줍니다.','2013-08-01 02:29:31','2013-08-01 02:29:31'),(70,15,'아이라인','- 짙은 브라운 아이섀도우를 이용해서 그라데이션 해주세요.','2013-08-01 02:29:44','2013-08-01 02:29:44'),(71,15,'아이라인','- 조금더 밝은 브론즈 컬러 아이섀도우를 이용해서 위를 연결시켜 주세요.','2013-08-01 02:30:10','2013-08-01 02:30:10'),(72,15,'아이라인','- 골드 컬러의 섀도우를 사용하여 전체적으로 발라주면 섀도우 연출 완성!!','2013-08-01 02:30:25','2013-08-01 02:30:25'),(73,15,'아이라인','- 하나더, 언더라인도 섀도우를 발라주면 또렷하고 그윽하게 눈매를 연출할 수 있어요.','2013-08-01 02:30:41','2013-08-01 02:30:41'),(74,16,'속눈썹','- 눈썹은 뷰러를 3번에 나누어서 올려주세요.(한번 꺾이면 안이뻐요.ㅠㅠ)','2013-08-06 06:55:20','2013-08-06 06:55:20'),(75,16,'속눈썹','- 마스카라를 올리거나 속눈썹을 붙여서 눈썹의 볼륨감을 높여주세요.(속눈썹 How-to 뷰토리얼을 참고해주세요)','2013-08-06 06:55:41','2013-08-06 06:55:41'),(76,16,'아이섀도우','- 검정색 섀도우를 이용해서 속눈썹을 붙인 위에 발라주세요. (또렷한 눈매연출이 가능합니다.)','2013-08-06 06:55:58','2013-08-06 06:55:58'),(77,16,'아이섀도우','- 브라운 컬러 펜슬을 이용해서 아래점막을 메워주세요.','2013-08-06 06:56:15','2013-08-06 06:56:15'),(78,16,'아이섀도우','- 점막을 매꾼위에 브라운 아이섀도우를 한번 더 덧발라주세요.(좀더 진한 메이크업을 하고싶으신분들은 블랙컬러를 사용하셔도 됩니다.)','2013-08-06 06:56:30','2013-08-06 06:56:30'),(79,16,'아이섀도우','- 브론즈 컬러를 이용해서 언더라인에 한번 더 쓸어주시면 됩니다.','2013-08-06 07:01:11','2013-08-06 07:01:11'),(80,16,'속눈썹','- 눈썹의 볼륨감이 2프로 부족하다고 느끼는 분들은 마스카라를 발라주셔도 됩니다.\r\n- 제품을 적당량 묻혀서 위쪽에서 바깥쪽으로 골고루 컬링해주세요.','2013-08-06 07:01:48','2013-08-06 07:01:48'),(81,16,'립스틱','- 스모키메이크업을 위해서는 입술화장은 조금 누드톤으로 연출하는 것이 좋아요. 누디핑크를 이용해서 입술을 메워주세요. 립스틱을 뭉게주듯이 발라주는게 입술을 세련되게 연출할 수 있어요.\r\n- 매트한 느낌의 립스틱을 이용하는게 세미스모키 메이크업 연출에 어울려요.','2013-08-06 07:02:09','2013-08-06 07:02:09'),(82,17,'Check POINT','- 스킨이나 로션을 바를때 화장솜은 피부결대로 발라주시는게 좋습니다. 안에서 밖으로, 위에서 밑으로.\r\n- 세안을 강하게 하면 상처가 오래가고 잘 낳지 않아요, 상처를 다루듯 살살~ 해주시면 금방 피부가 좋아져요.\r\n- 눈을 한번 비비면 다크서클의 블랙홀에 빠집니다.. 비비지 마세요\r\n- 로션을 바를때 눈은 자연스럽게 살짝 감고 발라주세요. 얼굴이 건조할때는 평소보다 좀더 발라주셔도 좋습니다.\r\n- 자외선 차단제를 바를때는 피부톤에 맞추어서 발라주세요.\r\n특히, 노출이 심한 부위에만 잘 발라주시는게 좋습니다. (눈가를 제외한 부위에 살짝 바르고 두들기듯이)\r\n- 천천이 발라주세요, 눈썹 주변은 많이 사용할시에 하얗게 남을 수 있으니 눈주변은 특히 조심히 발라주세요.\r\n- 햇볕에 장시간 노출될때엔 2, 3시간에 소량을 눈아래, 콧등위에 덧발라주세요.','2013-08-09 02:28:13','2013-08-09 02:29:39'),(83,18,'Check POINT','- BB 크림은 커버하고 싶은 곳에만 부드럽게 발라주세요.\r\n- BB크림 하나만으로도 모공이 커버되니 안심안심!!\r\n- 입술주변, 콧등, 주변에도 발라주세요\r\n- BB크림으로 입술 외곽주변에 바르고 립밤과 면봉을 이용하여 정리해주세요. 깔끔하게 정리하는 것은 필수!\r\n- 머리색깔과 눈썹색깔은 일치하는 것이 좋아요, 색깔이 다를경우는 마스카라로 가볍게 빗어주면 톤을 맞출 수 있습니다.\r\n- 눈썹 길이를 수정하고 싶은 경우, 원하는 길이까지 가볍게 살짝 발라주세요.\r\n- 눈썹을 잘못 정리하면 하얀 속살을 마주할지도...ㅠㅠ 눈썹 아랫쪽의 잔털만 정리해주면 눈썹 선을 좀더 날렵하게 해줄 수 있어요','2013-08-09 16:43:26','2013-08-09 16:43:26'),(84,18,'Questions','Q1) BB크림을 양쪽에 서로 다르게 바르면 어떻하죠?\r\n- 조금 진한 부위는 로션을 살짝 손에 묻혀 지우면 됩니다.\r\n\r\nQ2) 면도를 많이 해서 BB 크림을 발라도 피부가 안좋아 보여요.\r\n- 면도를 많이 해서 BB크림을 바르고 나서도 각질이 심할경우 로션을 가볍게 덧발라 주시면 됩니다.\r\n\r\nQ3 ) 눈썹이 진하게 그려졌으면 어떻하죠..\r\n- 로션을 면봉에 묻혀 눈썹에 가볍게 빗어주세요. 선크림을 지울때도 좋습니다.','2013-08-09 16:44:08','2013-08-09 16:44:08'),(85,19,'하이라이트란?','- 얼굴의 입체감을 살려주는 화장방법.\r\n- 밝아보이고 싶은 부위를 살짝 터치하는 정도만 하는 것이 중요해요. 한듯 안한듯하게 발라주어야 남이봐도, 그리고 사진을 찍어도 효과를 높일 수 있습니다.','2013-08-21 06:25:28','2013-08-21 06:28:50'),(86,19,'하이라이트 포인트','- 한 톤 정도 밝은 파우더를 약간 두꺼운 브러쉬를 이용해서 조금 묻힌후 털어주고 살짝 스친다는 기분으로 발라주세요.','2013-08-21 06:26:39','2013-08-21 06:28:57'),(87,19,'눈썹뼈','- 눈썹 뼈 있는부분에 살짝 터치후 쓸어줍니다.','2013-08-21 06:27:10','2013-08-21 06:29:04'),(88,19,'포인트','- 하이라이트는 펄감이 많은 것보다 살짝 윤기가 있는 정도가 좋아요.','2013-08-21 06:27:34','2013-08-21 06:29:12'),(89,19,'포인트','- 전체적으로 T 존에 발라주고 눈밑과, 인중, 턱에 발라주세요.','2013-08-21 06:27:59','2013-08-21 06:29:19'),(90,19,'눈밑','- 눈밑 역시 살짝만 스치듯이 발라주세요. 두껍게 바를경우 눈 주변의 주름이 더욱 두드러질 수 있으니 조심 >,<.','2013-08-21 06:28:19','2013-08-21 06:28:19'),(91,19,'포인트','- 얼굴이 짧은 경우 인중과 턱에 하이라이트를 넣어주면 더 길어보이는 효과가 있어요!! 반대로 얼굴이 긴경우는 턱에는 하지않는 것이 좋습니다.','2013-08-21 06:28:39','2013-08-21 06:28:39'),(92,20,'Check POINT','-  피부가 번들거리는 분들은 유분기가 없는 로션이 괜찮아요\r\n- 안경쓰시는 분들은 눈주변을 자주 만지게 되는데 주름이 많이 생기게 되니 주의!!(나중에 다크서클 생겨요.ㅠㅠ)\r\n- 여드름, 뽀루지를 너무 심하게 짜면 검게 착색이 되니 ㅠㅠ 적당히 짜는게 좋아요.!\r\n- 자외선 차단제는 스프레이타입이 피부 자극은 더 심해요. 하얀색 크림으로 잘 타는 부위를 커버하고 좀더 광택을 주고 싶은 부분에 하이라이트효과를 줄 수 있어요. 얋게 펴바르는 것이 중요!\r\n- BB크림은 커버하고 싶은 부위에만 조금 발라주세요. 피부에 자극을 많이 주는 경우 착색이 생기기 쉬우니 평소에 관리를 잘하고 BB크림, 자외선 차단제로 커버 해주는 것이 좋습니다. 여름에는 땀이 많이 나지만 자외선으로 인해 건조해지기 쉬워요. BB크림은 조금이라도 발라주는게 좋아요.\r\n-  아이섀도우를 끝부분에만 살짝 발라주면 눈매를 더욱 강하게 보일 수 있습니다.\r\n- 뷰러로 속눈썹의 뿌리를 올려주면 외꺼풀의 눈을 더욱 커보이게 할 수 있어요.\r\n-  아이라이너 펜슬로 눈매끝에 살짝 발라주면 더욱 섹시한 눈매를 연출할 수 있습니다. 남자들이 써도 괜찮아요!','2013-08-29 02:33:55','2013-08-29 02:33:55'),(93,21,'메이크업 준비','- 스킨, 수분 젤, 수분 크림, 선크림을 얇게 펴발라둡니다.\r\n(결혼식 당일, 메이크업샵에는 스킨/수분크림 정도만 바른 상태로 방문하시면 됩니다. )','2013-09-13 17:30:59','2013-09-13 17:30:59'),(94,21,'베이스','- 장시간 예쁜 화장을 위하여 워터프루프 제품으로 BB크림을 약간 섞어 바르면 당기지 않고 촉촉한 베이스를 만들어서 브러쉬나 손을 이용하여 바릅니다.\r\n- 조금씩 여러번에 나누어서 바르는 것이 커버력/지속력을 높일 수 있으며, 수분라텍스 등을 이용하여 공을 들여 두드려서 최대한 얇게 하여 피부를 더욱 돋보이게 해줍니다.','2013-09-13 17:31:19','2013-09-13 17:31:19'),(95,21,'컨실러','- 얼굴에 붉은기가 있는 부분을 컨실러로 커버해줍니다.','2013-09-13 17:31:33','2013-09-13 17:31:33'),(96,21,'파우더','- 파우더는 얼굴 외곽에만 살짝 발라줍니다. 촉촉한 피부표현과 수정 메이크업시에 밀리지 않게 하기 위하여, 파우더는 최소한만 사용하도록 합니다.','2013-09-13 17:31:46','2013-09-13 17:31:46'),(97,21,'셰이딩','- 전체적으로 작아보이는 얼굴을 위해서 셰이딩으로 넣어줍니다.','2013-09-13 17:32:05','2013-09-13 17:32:05'),(98,21,'하이라이트','- T존과 눈밑에 하이라이트를 넣어줍니다.\r\n(뷰티밋츠의 하이라이트 뷰토리얼을 참고하세요.)','2013-09-13 17:32:20','2013-09-13 17:32:20'),(99,21,'눈썹','- 인위적인 모양보다는 자신의 눈썹 모양을 최대한 살려서 자연스럽게 그려줍니다. (웨딩전에는 눈썹을 가능한 다듬지 않고 길러서 가는 것이 더 어울리는 눈썹을 그리기에 좋습니다.)','2013-09-13 17:32:40','2013-09-13 17:32:40'),(100,21,'아이섀도우','- 글리터가 들어있는 아이섀도우를 사용하여 블링블링한 느낌을 연출하여 줍니다.\r\n-  전체적으로 크림 섀도우를 바르고 난 후, 톤 다운된 핑크섀도우를 크림섀도우를 바른위에 덧발라줍니다.','2013-09-13 17:33:20','2013-09-13 17:33:20'),(101,21,'아이라인','- 내츄럴하면서도 또렷한 눈매 연출이 중요합니다. 워터프루프 제품을 이용하여 평소보다 1-2mm 정도 라인을 길게 빼서 그려주면 눈물자국도 방지할 수 있습니다.','2013-09-13 17:33:59','2013-09-13 17:33:59'),(102,21,'속눈썹','- 뷰러로 속눈썹을 올려준 뒤, 자연스러운 인조속눈썹을 사용하여 꼼꼼히 붙여줍니다. 언더라인은 과하지 않게 자연스럽게 살짝만 그려줍니다.','2013-09-13 17:34:14','2013-09-13 17:34:14'),(103,21,'볼터치','- 핑크색 블러셔로 애플존에 화사함을 살려줍니다. 볼에 홍조, 붉은기가 있는 분들은 강한 색을 사용하지 않도록 합니다. 볼터치 해 준 볼 위에 하이라이터로 살짝 포인트를 넣어 윤곽을 살려줍니다.','2013-09-13 17:34:34','2013-09-13 17:34:34'),(104,21,'입술','- 연한 핑크립스틱을 전체적으로 입술에 바르고, 핫핑크 컬러를 입술 안쪽에 바르면 입술에 꽃잎을 머금은 듯이 화사해집니다. 립글로스를 더하여 촉촉함을 up!!','2013-09-13 17:34:53','2013-09-13 17:34:53'),(105,21,'글리터','- 조금 더 화려한 글리터를 눈두덩이와 눈앞머리에 살짝 발라주면 식장에서 조명에 반사되어 눈매가 더욱 살아납니다.','2013-09-13 17:35:17','2013-09-13 17:35:17'),(106,26,' 촉촉한 피부 표현과 트러블 커버','- 오일프리 타입의 파운데이션으로 브러쉬를 이용해 얇게 펴고, 수분 라텍스로 \"살살 두들겨\" 발라줍니다.\r\n- 여드름이나 트러블이 난 부위에는 펜슬타입의 컨실러를 이용하여 한번 더 커버해주세요.\r\n- (TIP) 파우더를 두껍게 바르면 건조해지고 밀릴 수 있으니 최대한 자제하고 아이메이크업이 잘 번지지 않도록 눈두덩이, 눈썹 주위를 위주로!','2013-12-09 06:49:51','2013-12-09 06:49:51'),(107,26,' 윤곽을 살리는 볼터치, 하이라이팅, 셰이딩','- 얼굴의 화사함을 살리기 위해 콧등과 이마를 중심으로 하이라이트를 주고 애플존 위주로 볼터치해주세요.\r\n- 작아보이는 얼굴을 위해서 헤어라인과 턱라인을 위주로 어두운 파우더를 이용하여 셰이딩해주세요.','2013-12-09 06:50:13','2013-12-09 06:50:13'),(108,26,'인상을 좌우하는 아이메이크업','- 눈썹산이 너무 올라갔을 경우, 강한 인상을 줄 수 있기에 눈썹산을 완만하게 다듬어서 편안한 인상을 연출해주세요.\r\n- 또렷한 눈매를 위하여 뷰러를 이용하여 속눈썹을 C컬이 되도록 몇번에 나누어 올려주세요.\r\n- 그리고 선명한 인상을 주기 위하여 아이라이너로 써클렌즈 아이메이크업을 표현!\r\n- 외커풀에 눈이 살짝 올라가신 분들은 섀도우로 눈두덩이에 전체적으로 바를 필요 없이, 눈의 끝쪽만 살짝 연결해 주시면 눈이 커보이면서도 선해보이는 인상을 만들 수 있어요.\r\n- 짝눈이신 분들은 섀도우 하나로 짝눈 커버 메이크업을 할 수 있어요. (\'짝눈 커버 원터치 메이크업\' 뷰토리얼 참고)\r\n- 면접 메이크업에는 걸그룹 처럼 화려하게 하면 안되요! 평소엔 화려한 화장이 예쁘게 보이더라도, 면접날만큼은 피부표현을 중심으로 깔끔하게 보이도록 해요\r\n- 마스카라로 뷰러로 올린 속눈썹을 고정시켜주고, 풍성하게 표현해줍니다.','2013-12-09 06:51:07','2013-12-09 06:51:07'),(109,26,'차분해보이는 립메이크업','입술을 촉촉하게 립밤을 바르고 나서, 틴트로 입술안쪽으로 혈색을 더해주세요. 마지막으로 피치계열 립스틱을 덧발라주면 전체적으로 차분한 느낌을 연출할 수 있습니다.\r\n- (TIP) 펜슬타입 컨실러를 사용하여 입술선을 정리해주면 조금 더 또렷하고 깔끔해보여요','2013-12-09 06:51:32','2013-12-09 06:51:32'),(110,23,'메이크업 플랜','- 메이크업의 시작은 자신을 파악하는 것에서부터 시작\r\n- 큰눈만큼 작은눈에 섀도우를 발라줘요','2013-12-09 17:07:33','2013-12-09 17:07:33');
/*!40000 ALTER TABLE `beautorial_steps` ENABLE KEYS */;
