INSERT INTO `beautorials` VALUES (1,'푸시아 핑크 원포인트메이크업','소이현, 윤은혜와 같은 예쁜 연예인들의 필수 립 메이크업인 푸시아 핑크 메이크업! 봄을 이어서 여름을 맞이하는 지금도 강렬하게 핑크로 물들이고 있어요',3,'http://player.vimeo.com/video/67887378','2013-06-07 15:59:55','2014-01-14 19:33:54',784,'Screen_Shot_2013-06-08_at_01.05.13.jpg',7),(2,'대학생, 사회 초년생을 위한 네츄럴 메이크업-#1','학교에서는 신학기가 시작되고 사회에서는 새롭게 직장에 입사하여 메이크업을 처음 시작하는 분들이 어떻게 화장을 해야할지 많이 고민되시죠? 너무 과하지도 않고 그러면서도 자연스럽게 네츄럴 메이크업부터 시도해보세요. 오늘은 피부 표현에 대해서 말씀드릴께요.',5,'http://player.vimeo.com/video/66947916','2013-06-08 00:38:38','2014-01-14 17:37:32',1242,'Screen_Shot_2013-06-08_at_09.36.35.jpg',8),(3,'더운 여름 깔끔진 음영 메이크업 (#1) - 스킨케어 편','더운 여름 깔끔진 음영 메이크업 (#1) - 스킨케어 편\r\n여름철에도 하루종일 뜨지 않는 화장을 배워요. 그럴려면, 완벽한 스킨케어가 무엇보다 중요하다네요. 우리가 꼭 지켜야 하는 스킨케어 습관!! \r\n뷰티스타 김지현님과 손예슬 양이 함께 한 생생한 뷰티 TALK .',6,'https://player.vimeo.com/video/68306592','2013-06-14 15:44:18','2014-01-14 17:53:42',1413,'skincare.jpg',3),(4,'더운 여름 깔끔진 음영 메이크업 (#2) - 피부표현 편','더운 여름 깔끔진 음영 메이크업 (#2) - 피부표현 편\r\n여름철에도 하루종일 뜨지 않는 화장을 배워요. 들뜬다고 자꾸 \"팩트\" 쓰면 안되요!!!\r\n뷰티스타 김지현님과손 예슬 양이 함께 한 생생한 뷰티 TALK .',6,'https://player.vimeo.com/video/68374191','2013-06-14 15:47:52','2014-01-14 18:06:07',1877,'skinmakeup2.jpg',8),(5,'메이크업베이스 도구 ','브러쉬와 스폰지는 화장을 하면서도 결코 빼놓을 수 없는 필수품!!\r\n특히 메이크업베이스를 위해서는 손과 함께 다양한 도구들을 사용하게 됩니다. 오늘은 가장 기초이면서도 중요한 브러쉬 사용법과 스폰지 활용방법에 대해 알아볼께요.',5,'https://player.vimeo.com/video/66945591','2013-06-14 16:15:47','2014-01-12 18:15:57',513,'brush_sponge.png',4),(6,'고준희 음영 EYE 메이크업','요새 가장 핫한 고준희의 음영 메이크업 따라하기 !!\r\n\r\n일반인을 대상으로 메이크업을 알려주는 메이크업 홈클래스 원장, 뷰티스타 조수연님의 생생한 고준희 음영 메이크업 따라하기. 천천히 따라해보아요',1,'https://player.vimeo.com/video/68419185','2013-06-15 11:16:23','2014-01-14 23:44:21',3457,'ko.png',7),(7,'피부의 촉촉함과 매력을 더해주는 물광 메이크업','피부의 촉촉함과 매력을 더해주는 물광 메이크업 따라하기 \r\n\r\n일반인을 대상으로 메이크업을 알려주는 메이크업 홈클래스를 운영하는 \r\n뷰티스타 조수연님의 생생한 물광 메이크업 따라하기. 천천히 따라해보아요',1,'https://player.vimeo.com/video/68595858','2013-06-18 11:46:47','2014-01-13 11:35:14',653,'water.png',1),(8,'나에게 맞는 볼터치','나에게 맞는 볼터치 : 어두운 피부, 여름철 태닝 피부\r\n\r\n블러셔에도 유행이 있다? 어두운 피부, 여름철 태닝 피부 - 살구빛 컬러 추천!! \r\n',5,'https://player.vimeo.com/video/68655578','2013-06-20 05:46:53','2014-01-14 21:28:49',478,'320-0.png',4),(10,'대학생, 사회 초년생을 위한 네츄럴 메이크업-#2','학교에서는 신학기가 시작되고 사회에서는 새롭게 직장에 입사하여 메이크업을 처음 시작하는 분들이 어떻게 화장을 해야할지 많이 고민되시죠? 너무 과하지도 않고 그러면서도 자연스럽게 네츄럴 메이크업부터 시도해보세요. 오늘은 피부 표현에 대해서 말씀드릴께요.',5,'https://player.vimeo.com/video/68822095','2013-06-21 03:27:04','2014-01-14 17:37:46',841,'Screen_Shot_2013-06-08_at_09.36.35.jpg',8),(11,'3초만에 눈이 커지는 써클렌즈 EYE 메이크업','눈 주변에 스윽스윽 3초만에 써클렌즈를 낀것처럼 눈이 커지고 선명해집니다. 뷰티밋츠의 뷰티스타, 김지현 부원장님이 전해주시는 깨알같은 아이메이크업 팁!! ',6,'https://player.vimeo.com/video/70188685','2013-07-15 02:28:51','2014-01-15 01:08:37',1368,'circlelenz_up.jpg',1),(12,'깔끔진 음영 메이크업 (#3) - 눈썹, 아이섀도우','더운 여름 깔끔진 음영 메이크업 (#3) - 눈썹, 아이섀도우편\r\n여름철에도 하루종일 뜨지 않는 화장을 배워요.  뷰티스타 김지현님과손 예슬 양이 함께 한 생생한 뷰티 TALK .',6,'https://player.vimeo.com/video/70454380','2013-07-19 07:43:41','2014-01-14 22:23:50',1895,'eyemakeup.jpg',1),(13,'깔끔진 음영 메이크업 (#4) - 아이라인, 마스카라','더운 여름 깔끔진 음영 메이크업 (#4) - 아이라인,마스카라편\r\n여름철에도 하루종일 뜨지 않는 화장을 배워요. 뷰티스타 김지현님과손 예슬 양이 함께 한 생생한 뷰티 TALK .',6,'https://player.vimeo.com/video/70609056','2013-07-19 07:45:57','2014-01-14 18:06:20',2109,'thumbnail_4_up.jpg',1),(14,'속눈썹 How-to','속눈썹, 연예인들이 남들이 붙인 눈썹들 보면 나도 따라해봐야지 하면서도 매번 붙이실려고 하면 고민이 많이 되셨죠?\r\n뷰티스타 조원경님이 말씀해주시는 팁들을 한번 살펴보고 우리도 한번 도전해봅시다. 속눈썹!!',5,'https://player.vimeo.com/video/71186311','2013-07-29 01:35:08','2014-01-12 19:18:09',344,'eyelash_thumbnail.jpg',4),(15,'세미 스모키 메이크업 #1','언제나 주목받는 메이크업, 스모키 메이크업!!\r\n좀더 다가가기 쉽게 세미 스모키 메이크업에 대해서 알아봅시다, 뷰티스타 조원경님이 전해주시는 세미스모키 메이크업 Part1 입니다.',5,'https://player.vimeo.com/video/71350126','2013-07-31 16:25:18','2014-01-14 14:57:03',450,'semi_smokyup__1_thumbnail.jpg',1),(16,'세미 스모키 메이크업 #2','언제나 주목받는 메이크업, 스모키 메이크업!! 좀더 다가가기 쉽게 세미 스모키 메이크업에 대해서 알아봅시다, 뷰티스타 조원경님이 전해주시는 세미스모키 메이크업 Part2 입니다.',5,'https://player.vimeo.com/video/71508430','2013-08-06 06:15:39','2014-01-12 19:06:59',293,'semi_smokyup__2_thumbnail.jpg',1),(17,'보통남자의 훈남피부 따라잡기(#1)','남자들이라면 누구나 고민거리인 푸석거리는 피부, 스킨과 로션, 자외선 차단제는 어떻게 발라야할지... 매직터치 김슨생과 함께 훈남피부를 만들어봅시다. 남자들은 필수 시청!!',6,'https://player.vimeo.com/video/71486708','2013-08-09 01:54:53','2014-01-14 13:42:00',321,'JMJ_thumbnail.jpg',6),(18,' 보통남자의 훈남피부 따라잡기(#2)','남자들이라면 누구나 고민거리인 푸석거리는 피부, 스킨과 로션, 자외선 차단제는 어떻게 발라야할지... 매직터치 김슨생과 함께 훈남피부를 만들어봅시다. 남자들은 필수 시청!!',6,'https://player.vimeo.com/video/71953324','2013-08-09 16:32:31','2014-01-14 13:42:21',422,'JMJ_thumbnail2.jpg',6),(19,'얼굴의 입체감을 살려주는 하이라이트 넣어주기','하이라이트???\r\n\r\n얼굴에 어디가 돋보여야 하는지 어떻게 음영을 넣어줘야 하는지 순서도 모르겠다?, 어려우시죠??ㅠㅠ\r\n\r\n뷰티스타 조원경님이 말씀해주시는 메이크업의 기본, 얼굴의 입체감을 살려주는 하이라이트 방법으로 우리모두 3D 얼굴을 만들어봐요!!',5,'https://player.vimeo.com/video/72430034','2013-08-21 06:20:34','2014-01-14 14:56:07',512,'highlight_thumbnail.jpg',4),(20,'피부는 촉촉하게, 눈은 또렷하게!!','매직터치 김슨생의 남성 뷰티TALK 2탄. 오늘은 피부는 더욱 촉촉하게 그리고 눈을 더욱 또렷하게 연출할 수 있는 방법을 배워봅니다. 그럼 LET\'S GO',6,'https://player.vimeo.com/video/71500570','2013-08-29 02:00:40','2014-01-14 18:09:09',316,'SJLee_thumbnail2.png',6),(21,'완벽한 웨딩 데이, 웨딩 메이크업','다가오는 10월 주변의 친구들의 결혼과 앞으로의 나의 결혼을 위한 완벽한 준비, 웨딩 메이크업을 준비해봐요!',5,'https://player.vimeo.com/video/74277028','2013-09-13 17:10:38','2014-01-14 14:33:36',295,'wedding_thumb.jpg',7),(23,'짝눈커버 원터치 메이크업','눈의 크기가 달라서 고민인 당신, 매직터치 김슨생이 한번의 터치로 짝눈을 커버할 수 있는 비법을 공개합니다. 모두 플레이!!',6,'https://player.vimeo.com/video/78913105','2013-11-11 09:23:38','2014-01-13 18:15:50',455,'beautorial_thumb.png',4),(24,'내 남자의 시크릿 메이크업(#1)','여드름 피부가 고민인 나의 남자친구, 이영상으로 말끔한 피부로 돌아와줘요.>.<',6,'https://player.vimeo.com/video/77775612','2013-11-12 14:19:06','2014-01-14 13:01:22',239,'eyecovermakeup.png',6),(25,'내 남자의 시크릿 메이크업(#2)','여드름 피부가 고민인 나의 남자친구, 이영상으로 말끔한 피부로 돌아와줘요.>.<',6,'https://player.vimeo.com/video/77693566','2013-11-13 08:37:41','2014-01-14 20:28:04',655,'eyecovermakeup2.png',6),(26,'호감도 UP! 깨끗한 첫인상 메이크업','본인이 가지고 있는 결점들이 메이크업 할때 많이 고민이 되세요? 짝눈과 외꺼풀을 커버하면서도 깨끗하고 호감형인상을 만들어주는 매직터치 김슨생의 뷰토리얼, 지금 보고 가실게요!!',6,'https://player.vimeo.com/video/80970885','2013-12-09 06:14:07','2014-01-14 17:34:13',1134,'thumb.jpg',1);
