INSERT INTO `news` VALUES (1,'뷰티밋츠 기능이 업데이트되었습니다.','<p>1. 홈화면의 <strong>뷰티스타 위치</strong>가 자유롭게 변경됩니다. 그 사이에 또 다른 뷰티스타분들이 두둥~하고 등장하시겠죠? 기대해주세요</p>\r\n\r\n<p>\r\n2. 뷰티스타의 \'응원 숫자\'가 뷰티스타페이지 안으로 쏘옥~ 들어갔습니다. 그리고 뷰티스타의 <strong>방문자수</strong>를 뷰티스타페이지 안에서 보실 수 있어요, 뿌잉뿌잉!<br/>\r\n<img src=\"/uploads/news/news_1_2.png\">\r\n</p>\r\n\r\n<p>\r\n3. 뷰티스타에게 남길 수 있는 <strong>댓글 기능</strong>이 추가되었습니다. 현재는 <strong>웹</strong>에서만 사용하실 수 있어요<br/>\r\n<img src=\"/uploads/news/news_1_3.png\">\r\n</p>\r\n\r\n<p>\r\n4. 화면 아래 하단에 <strong>Facebook 좋아요 링크</strong>가 추가되었습니다. 모두들 기분좋게 눌러주세요 ~*<br/>\r\n<img src=\"/uploads/news/news_1_4.png\">\r\n</p>\r\n\r\n<p>\r\n5. 뷰티밋츠 소식을 전해드릴 <strong>뉴스 카테고리</strong>가 생겼습니다. \r\n자주 방문해주시면서 새로 업그레이드 되는 소식에 귀기울여 주세요.<br/>\r\n<img src=\"/uploads/news/news_1_5.png\">\r\n</p>\r\n\r\n<p>\r\n앞으로도 더욱 노력하는 뷰티밋츠 팀이 되겠습니다. 궁금한 건 우측, 아래측에 있는 <i class=\"icon-envelope\"></i> 버튼이나 hellobeauty@reallplay.com으로 연락주세요~!!! 감사합니다.\r\n</p>',157,'2013-02-11 09:55:49','2013-11-06 06:47:11'),(2,'뷰티스타분들의 소개 영상이 추가되었습니다.','안녕하세요,  BEAUTYMEETS 입니다. \r\nBEAUTYSTAR분들의 소개영상이 하나씩 추가되고 있어요, 짧은 영상이지만 많이많이 보시고 응원에 메세지, 추천 부탁드려요 :)<br/>\r\n아울러, Youtube나 Vimeo를 좋아하시는 분들은 해당 사이트에서도 뷰티스타분들의 소개영상을 만나실 수 있어요. 많은 분들이 보시고, 피드백 주시면 더 즐거운 BEAUTYMEETS 서비스를 만들겠습니다. <br/>\r\nYoutube : http://www.youtube.com/BEAUTYMEETS\r\nVimeo : http://vimeo.com/BEAUTYMEETS<br/>\r\n궁금한 것은 언제든지 아래 이메일이나 우측(모바일에서는 아래) 편지로 연락주셔도 좋습니다.<br/>\r\n뷰티밋츠 서비스팀.',141,'2013-03-08 12:30:51','2013-11-06 06:47:08');
