40:37','2013-01-31 17:45:36'),(55,'',3,'6-5.jpg','어두운 피부를 위한 브론징 메이크업이에요. 심심하지 않게 블루 아이섀도우로 포인트를 줬어요. 사실 얼루어 ‘나도 메이크업 스타’에서 우승을 한 룩이랍니다','2013-01-31 17:40:47','2013-01-31 17:46:04'),(56,'',3,'6-6.jpg','데일리 룩으로 딱인 메이크업이에요. 전체적으로 내츄럴한 색상을 사용해서, 자연스러워 보이도록 했어요.','2013-01-31 17:40:57','2013-01-31 17:46:26'),(57,'',3,'6-8.jpg','스톤과 글리터를 이용한 파티 아이메이크업이에요. 평소에 너무 평범한 메이크업이 질릴때는 스톤 하나로 기분을 업시킬수 있어요!','2013-01-31 17:41:13','2013-01-31 17:46:58'),(58,'',3,'6-9.jpg','전체적으로 글래머스한 느낌을 낸 룩이에요. 사실 발렌타인데이 메이크업이랍니다 호호. 발렌타인데이 하면 대부분 파스텔톤의 핑크를 떠올리시는데, 강렬하고 섹시한 레드로 분위기를 내는것도 좋을것 같아요','2013-01-31 17:41:25','2013-01-31 17:47:17'),(59,'',3,'6-1.jpg','봄을 담은 오렌지빛 메이크업이에요. 순수한 시골처녀같은 느낌을 주려고 했어요!','2013-01-31 17:57:48','2013-01-31 17:57:48'),(60,'',4,'Untitled-1.jpg','','2013-04-14 15:50:18','2013-04-14 15:50:18'),(61,'',4,'Untitled-2.jpg','','2013-04-14 15:50:29','2013-04-14 15:50:29'),(62,'',4,'Untitled-3.jpg','','2013-04-14 15:50:40','2013-04-14 15:50:40'),(63,'',4,'Untitled-4.jpg','','2013-04-14 16:01:29','2013-04-14 16:01:29'),(64,'',4,'Untitled-5.jpg','','2013-04-14 16:01:42','2013-04-14 16:01:42'),(65,'',4,'Untitled-6.jpg','','2013-04-14 16:01:54','2013-04-14 16:01:54'),(66,'',4,'Untitled-7.jpg','','2013-04-14 16:02:15','2013-04-14 16:02:15'),(67,'',4,'Untitled-8.jpg','','2013-04-14 16:02:29','2013-04-14 16:02:29'),(68,'',4,'Untitled-9.jpg','','2013-04-14 16:02:42','2013-04-14 16:02:42'),(69,'',4,'Untitled-10.jpg','','2013-04-14 16:03:21','2013-04-14 16:03:21'),(70,'',4,'Untitled-11.jpg','','2013-04-14 16:03:45','2013-04-14 16:03:45'),(71,'',4,'Untitled-13.jpg','','2013-04-14 16:04:19','2013-04-14 16:04:19'),(72,'',5,'PC210314.jpg','','2013-04-22 13:01:16','2013-04-22 13:01:16'),(73,'',5,'naver_com_20130410_014549.jpg','','2013-04-22 13:01:24','2013-04-22 13:01:24'),(74,'',5,'A6-1.jpg','','2013-04-22 13:01:30','2013-04-22 13:01:30'),(75,'',5,'MIB__1_.jpg','','2013-04-22 13:01:39','2013-04-22 13:01:39'),(76,'',5,'MIB__2_.jpg','','2013-04-22 13:01:46','2013-04-22 13:01:46'),(77,'',5,'_