INSERT INTO `products` VALUES (1,'립밤 SPF15','E1FN_l.jpg','입술을 보호하고 진정시켜주는 입술 전용 보호 제품.\r\n\r\n사용 추천: 모든 피부 타입\r\n\r\n사용 방법:필요한 경우 수시로 바릅니다. \r\n팁: 처음에 제품을 개봉하면 표면이 매우 딱딱해 보이므로, 코팅된 면을 세게 눌러서 표면을 깨트린 다음 손가락 끝으로 잘 섞어서 사용합니다.\r\n\r\n주요 성분: 알로에베라잎추출물 외\r\n*자외선 차단 기능성 심사 필\r\n\r\n원산지: 캐나다\r\n\r\n',34,'2013-06-07 16:03:07','2014-01-14 01:51:43',1),(2,'모이스쳐라이져','1491291_1.jpg','',29,'2013-06-07 17:01:08','2014-01-14 07:36:00',2),(3,'프로 롱웨어 컨실러 ','f129840464351368750_0_.jpg','편안하고 내추럴하게 산뜻한 피니쉬로 미디움 정도부터 완벽한 커버가 가능한 가벼운 플루이드 컨실러\r\n\r\n\r\n\r\n피부타입 : 모든 피부 타입\r\n주요성분 : 정제수, 소듐하이알루로네이트, 잔탄검 외  ',152,'2013-06-07 17:01:28','2014-01-14 03:15:48',3),(4,'푸에르토 발라르타 멀티플','f0286882_5159c1d0450c8.jpg','',83,'2013-06-07 17:01:44','2014-01-13 05:15:10',4),(5,'브라우 펜슬','1469974_1.jpg','파우더 포뮬라의 브라우 펜슬로 자연스러운 눈썹을 쉽게 표현해 줍니다. \r\n\r\n사용 추천: 눈썹 모양을 잡고 눈썹이 없는 부분이나 불규칙하게 난 부분을 채우고 싶은 분\r\n',14,'2013-06-07 17:02:06','2013-12-29 21:05:24',1),(6,'샴페인 쿼츠 ','Screen_Shot_2013-06-08_at_09.10.21.jpg','',29,'2013-06-07 17:02:29','2014-01-12 09:55:05',1),(7,'이프노즈 스타 마스카라','db17_big075.jpg','No.1* 마스카라 랑콤이 선보이는 \"\"무비스타\"\" 마스카라, 이프노즈 스타.\r\n\r\n속눈썹을 뿌리부터 한올한올 깔끔하고 풍성하게 해주는 울트라 글램 볼륨 마스카라입니다.\r\n\r\n깊고 풍성한 매혹적인 무비스타 눈매의 시크릿!\r\n랑콤이 독자적으로 개발한 \'듀얼 브러쉬\'는 속눈썹을 뿌리부터 한 올 한올 깔끔하고 풍성하게 볼륨을 살려주어 더욱 글래머러스한 눈매로 연출해줍니다.',16,'2013-06-07 17:02:45','2013-12-29 21:05:48',5),(8,'롱웨어 젤 아이라이너','bobbi_el_3.jpg','아이라인을 드라마틱하게 연출하면서도 지속력이 우수하여 물에 잘 지워지지 않는 젤 타입 아이라이너. \r\n\r\n사용 추천: 오래 지속되는 리퀴드 라이너의 룩을 원하는 분\r\n\r\n사용 방법:울트라 파인 아이라이너 브러쉬모의 양쪽 면에 젤 라이너를 묻힙니다. 눈에 아이라인을 그리기 전에 여분의 젤 라이너를 티슈로 살짝 닦아 냅니다. 이 제품은 마르는 순간 수정이 되지 않으므로 빠르게 아이라인을 그립니다.\r\n\r\n주요 성분: 트리메칠실록시실리케이트 외\r\n\r\n원산지: 벨기에\r\n',12,'2013-06-07 17:02:59','2014-01-12 02:21:52',1),(9,'룩셈부르크 립 펜슬','nars-satin-lip-pencil-luxembourg.jpg','나스의 아이코딕 프로덕트인 벨벳 매트 린 펜슬, 벨벤 글로스 립 펜슬처럼 크레용 펜슬 타입으로 입술의 실루엣을 연출하거나 그라데이션하기 쉽게 고민되었으며 휴대가 용이힙니다.',46,'2013-06-07 17:03:25','2014-01-12 08:19:28',4),(10,'크리미 매트 립 칼라','E8G2_l.jpg','8시간 지속되는 뛰어난 발색력, 크리미하면서도 매트한 신개념 립 칼라! \r\n바비 브라운의 혁신적인 매트 립스틱으로 크리미하면서도 부드러운 느낌과 함께 클래식하고 매트한 입술표현을 연출해 주는 매력적인 제품입니다. 촉촉한 텍스쳐와 가벼운 터치감, 선명한 발색력과 놀라운 지속력을 모두 갖춘 새로운 립스틱입니다.\r\n\r\n사용 추천: 매트하고 우수한 발색의 립스틱을 원하는 분\r\n\r\n사용 방법: 립스틱을 바로 사용하거나 립브러쉬를 사용하여 깨끗한 입술 또는\r\n\r\n주요 성분: 이소세틸스테아레이트 외\r\n\r\n원산지: 이탈리아 / 벨기에',21,'2013-06-07 17:03:40','2014-01-14 07:34:38',1),(11,'모이스춰 바운드 스킨 에너지 미스트 ','1478964_1.jpg','건조한 피부에 즉각적인 수분을 공급하는 대나무 수액 미스트\r\n                                                    타입 : 모든 피부 타입\r\n\r\n                                                    물 대신 대나무 수액을 이용한 독특한 처방의 수분 공급 미스트 입니다. \r\n                                                    미네랄이 풍부한, 수분을 함유한 식물 성분들의 섬세한 미스트가 피부에 닿는 순간 신속한 롱 래스팅 수분 공급 효과를 드립니다.\r\n\r\n                                                    피부에 집중적으로 활력을 제공하고 미네랄을 공급하기 위해 물 대신 안정화 시킨 대나무 수액을 사용한 워터 프리 포뮬러입니다.\r\n\r\n                                                    아모레퍼시픽만의 독점 성분 홍삼 추출물이 집중적으로 활력을 부여할 뿐 아니라 항산화 및 노화 완화 효과를 제공합니다.\r\n                                                    송이버섯 추출물이 피부결을 진정시켜 부드럽게 해 줍니다.',55,'2013-06-08 01:55:08','2014-01-12 11:44:59',7),(12,'딥 수퍼 하이드라온','g201201292255_1_detail.jpg','2011년부터 \'청담동 수분젤\'이라는 별칭이 생긴 딥은 일반적인 보습 제품의 베이스로 쓰이는 정제수를 사용하지 않고 국내산 자작나무 수액만을 베이스로 사용해 보습감과 피부 진정효과가 탁월합니다. \r\n\r\n \r\n다양한 미네랄, 당, 아미노산이 풍부한 자작나무수액 베이스에 피부 안팎 수분을 모아주는 데 도움을 주고자 고분자, 저분자 히아루론산이 함유되어 건조하고 메마른 피부, 손상된 피부의 수분지수를 끌어올려주어 촉촉한 피부로 가꾸어줍니다.',59,'2013-06-08 01:56:16','2013-12-29 21:05:12',6),(13,'아트블러셔(로즈핑크)','156217413.jpg','- 팬에 구워만든 베이크드 타입의 블러셔로 가루날림이 없고 발색이 뛰어납니다.\r\n- 다양한 컬러가 어우러진 마블링 텍스쳐로 자연스럽고 세련된 컬러 연출을 할 수 있습니다.\r\n0 피부 밀착력이 우수하여 색상이 오래 지속되고 묻어나지 않습니다. ',1,'2013-06-08 03:14:37','2013-06-08 03:18:49',8),(17,'스팀 글로우 크림','01_39900834_TSX2.jpg','팀 유화 공법으로 더욱 순한 윤광 안색 크림',76,'2013-06-08 12:35:32','2014-01-12 06:03:53',9),(18,'실키 & 매트 프라이머','ct12071853_1.jpg','피부결은 매끈하게 메이크업은 오래 지속시켜주는 프라이머!!\r\n\r\n부드러운 밤타입으로 퍼프로 얇고 가볍게 발라 답답하지 않게 실크같은 피부결로 연출해줍니다.\r\n\r\n넓어진 모공과 울퉁불퉁한 피부결을 투명하게 메워주어 매끈한 피부로 완성시켜줍니다.\r\n\r\n밀착력이 높고 부드럽게 발려 다음단계 화장의 지속력을 높여주어 메이크업이 오래 유지되도록 도와줍니다. ',61,'2013-06-08 12:35:50','2014-01-12 00:34:03',11),(19,'M 시그니쳐 리얼컴플릿 BB 크림','1414556_1.jpg','',47,'2013-06-08 12:36:18','2014-01-05 15:06:46',12),(20,'퓨어 래디언트 틴티드 모이스쳐라이져','1796111_1.jpg','자연스럽게 빛나는 피부, 뛰어난 커버력 그리고 촉촉한 사용감의 틴티드 모이스처라이저.\r\n\r\n1. \'피부 표현은 결점없이 완벽해야 하고, 메이크업은 스킨을 빛나게 하여야 한다.\'는 프랑수아 나스의 철학은 메이크업을 돋보이게 하는 매끈한 피부 표현을 위한 제품을 탄생시키는 배경이 되었습니다.\r\n2. 가볍게 발리면서도 피부톤을 고르게 해주고, 촉촉한 사용감을 선사합니다.\r\n3. 오일 프리 포뮬러가 주름, 모공 등의 피부 결점을 말끔하게 가려주고, 강화된 스킨케어 기능으로 지속적으로 사용시 맑은 피부를 가꾸는데 도움이 됩니다.\r\n4. 코파라라는 자연 다당류가 포함되어 있어 피부를 촉촉하고 건강하게 유지해주며 자외선 차단 기능으로 자외선에 의한 피부 데미지를 극소화합니다.',80,'2013-06-08 12:36:35','2014-01-12 00:33:20',4),(21,'광래스팅 듀얼 글로우 팩트(21호)','1953062_1.jpg','얼굴 입체에 따라 펄매칭의 컬러구성으로 입체감 있는 얼굴 표현을 해주고, 얼굴 빛을 하루종일 맑고 광채나게 커버해주는 하이라이트와 팩트가 결합된 펙트',134,'2013-06-08 12:36:56','2014-01-14 07:26:14',10),(22,'잇 샤이니 쉬머크림','banilaco_itshinny.png','',226,'2013-06-15 01:36:35','2014-01-13 04:59:27',13),(23,'더블웨어 스테인 인 플레이스 메이크업','1452985_1.jpg','',357,'2013-06-15 01:48:57','2014-01-13 09:42:33',14),(24,'소바','mac_soba.png','',311,'2013-06-15 11:20:58','2014-01-12 08:54:48',3),(25,'에스프레소','mac_eyeshadow_espresso.png','',213,'2013-06-15 11:21:56','2014-01-14 07:34:31',3),(26,'플루이드 아이라이너(딥다운)','6190020000302.jpg','',128,'2013-06-15 11:23:12','2014-01-14 02:07:52',3),(27,'쉬머 워쉬(로즈골드)','1474848_1.jpg','',303,'2013-06-15 11:23:45','2014-01-14 03:55:03',1),(28,'매그넘 볼륨 익스프레스','maybelline_magum_volume_express.png','',44,'2013-06-15 11:24:11','2013-12-29 21:05:10',15),(29,'라비슁','mac_ravishing.png','',195,'2013-06-15 11:24:25','2014-01-14 03:07:28',3),(30,'모란지','mac_morange.png','',128,'2013-06-15 11:24:36','2014-01-12 04:35:35',3),(31,'NaPCA 모이스처 미스트','nuskin-142.jpg','',49,'2013-06-18 16:01:24','2014-01-13 20:37:58',17),(32,'에센셜 아쿠아 에센스','5785800728.20120211194703.jpg','',21,'2013-06-18 16:04:56','2014-01-13 19:05:02',16),(33,'캐슬듀 워터샷 베이스','1342475183.png','',39,'2013-06-18 16:05:45','2014-01-09 20:04:47',10),(34,'쉐이딩 하이라이팅 듀오 파우더','2712929990_01_m.jpg','',26,'2013-06-18 1