INSERT INTO `stars` VALUES (1,'_______.jpg','화장품이 너무 좋아서 메이크업 브랜드 맥(M.A.C)에서 메이크업 아티스트를 시작하였습니다.\r\n현재는 전문 스튜디오에서 광고 및 사보 등 다양한 촬영의 메인 아티스트로서, 일반인을 대상으로 하는 \'메이크업 홈 클래스\'를 운영하며\r\n많은 화장품에 둘러 쌓여 너무나도 행복한 하루하루를 보내고 있습니다.\r\n\r\n메이크업의 관심이 뜨거워진 요즘, 이쁘게 화장을 하고자 하는 마음은 굴뚝 같으나 , 화장 방법을 잘 알지 못해 못하시는 분들.\r\n매일 똑같이 하는 익숙한 메이크업에서 벗어나, 나만의 변화를 원하시는 분들. \r\n우리가 매일  똑같은 옷을 입지 않듯이 메이크업도 상황에 맞게 그리고 그날의 의상에 맞게 멋진 연출을 할 수 있답니다. \r\n제가 알고 있는 노하우와 스킬을 여러분께 알려드리겠습니다. \r\n\r\n세상에 아름답지 않은 여성은 없습니다. 단지, 그 방법을 아직 잘 모를 뿐입니다. 여러분의 변신은 언제라도 시작될 수 있습니다. 지금 같이 시작하세요.','2013-01-28 02:33:43','2014-01-14 15:28:50',3009,'Make-up Artist','Sooyeon Cho','http://player.vimeo.com/video/60047755?title=0&amp;byline=0&amp;portrait=0','http://blog.naver.com/muhomeclass','','https://www.facebook.com/muhomeclass',''),(2,'____.jpg','의상디자인을 전공하여 스타일 리스트로서 활동을 시작, 영역을 확장하여 메이크업 아티스트로 전향하였습니다.\r\n토털 뷰티샵 끌로에 청담본점에서 메이크업 아티스트로 근무후, 현재는 오블리쥬에서 메이크업 아티스트로 활동 중입니다.\r\n\r\n작품 전시 및 뷰티 작가 등으로 활동하였으며,  CF, 쇼, 웨딩, 방송, 교육 강사 등 다양한 분야에서 많은 분들과 함께 즐겁게 일을 하고 있습니다.\r\n\r\n저는 Make Up이란 \'채우고 만든다\'라고 생각합니다. \r\n그 사람이 가진 가장 아름다운 모습을 연출함으로써 단지 겉모습 뿐 아니라, 내면의 자신감마저 채워주는 의미 있는 일이라고 생각하고 있습니다.\r\n\r\n더욱 당당하고 아름다운 내가 될 수 있도록, 여러분의 마음까지 만져드리는 메이크업 아티스트로서 도와드리겠습니다.','2013-01-28 06:46:52','2014-01-13 15:05:10',2278,'Make-up Artist','Diana Dayoung Lee','http://player.vimeo.com/video/61089068?title=0&amp;byline=0&amp;portrait=0','http://blog.naver.com/savie34','','https://www.facebook.com/dianadayounglee',''),(3,'1_-_____2.jpg','어릴때부터 집에 있는 패션 잡지에서 뷰티섹션을 하루종일 들여다는걸 좋아하던 저는 대학 새내기가 되며 메이크업을 시작하게 되었고,\r\n화장을 잘한다는 칭찬을 받으면서 친구들의 권유로 싸이 뷰티 블로그를 운영하기 시작하였습니다. \r\n처음엔 아무런 기대 없이 메이크업 방식을 올렸는데, 운이 좋게 많은 여자 분들의 관심과 사랑을 받게되머 감사한 마음으로 블로그를 운영하고 있습니다.\r\n\r\n싸이월드 2012 TOP 100 뷰티 블로거 선정. \r\n패션 매거진 얼루어 \'2011 나도 메이크업 스타’ 샤넬 부분 수상. \r\n케이블 채널 온스타일의 겟잇뷰티 ‘도전 셀프 메이크업’ 2012년 7월 1등 수상. \r\n서울여자대학교와 아주대학교에서 메이크업 강연 진행 2012년.\r\nMake up은 \'모든 여성분들의 아름다움과 동시에 자신감을 끌어내는 기특한 아이\'죠!  메이크업과 화장품을 너무 좋아하는 20대 초반 처자로, 세상 모든 여성분들의 뷰티 멘토가 될 때까지 멈추지 않겠어요!!!','2013-01-29 04:02:02','2014-01-14 07:31:29',5764,'Beauty Blogger','Dahye Kim','http://player.vimeo.com/video/63225572?title=0&amp;byline=0&amp;portrait=0','http://www.cyworld.com/dahyeshkablog','https://twitter.com/dahyeshka','https://www.facebook.com/dahyeshkablog',''),(4,'cover.png','\"내가 하는 메이크업은 아름다움을 넘어선 자신감이다\".\r\n\r\n현재 저는 토털뷰티샵 엔끌로에의 메이크업 아티스트로서 다양한 브랜드의 패션쇼, 광고, TV 프로그램 등에서 활동하고 있습니다. 처음엔 스타일리스트로 활동을 시작하다, 메이크업에 더 큰 매력을 느끼어 공부를 시작하게 되었는데, 벌써 메이크업 아티스트로 활동한지 20여년이 지났네요. ^^\r\n\r\n시간이 지나면서, 단순히 메이크업을 일로서 잘 하는 것 뿐 아니라 제가 아는 것과 경험한 것을 나누고 싶은 마음에 일반인분들과 가까이서 만나기 위하여 아카데미, 학교 등에서 강의 활동을 열심히 하고 있습니다. 메이크업 아티스트라는 직업이 여러분에게 좀 더 가까이 다가설 수 있도록, 그리고 또 여러분들이 더 예뻐질 수 있도록 도움을 드리도록 편안한 메이크업 아티스트로써 오랫동안 많은 여성분들에게 다가가고 싶습니다.','2013-04-14 15:38:43','2014-01-13 11:15:52',2010,'Make-up Artist','Wonkyung Cho','http://player.vimeo.com/video/63984489?title=0&amp;byline=0&amp;portrait=0','http://blog.naver.com/sonimom','','https://www.facebook.com/happyvirus114',''),(5,'201303280647461114_1.png','요새 한창 주가 상승중인가수 정인씨가 항상 말해요. “이건 화장이 아니라 성형이에요! ㅎㅎㅎ” \r\n라디오스타 프로그램에서 바로 폭로했던, 그 의사선생님이 바로 저, 김지현입니다.\r\n\r\n\r\n저는 청담동 토탈뷰티 살롱 작은 차이의 메이크업 아티스트로서, 웨딩 메이크업과 여러 연예인들 (정인, 구은애, 윤미래, 린 등)을 담당하고 있어요. \r\n제가 손만 대면, 마술같은 변화를 만든다고 하여 “매직터치, 김슨생!” 이라고 불린답니다\r\n하하하...어려보이는 외모와는 달리 저 벌써 14년 경력이라고 하시면 믿으실까요? (하하하)\r\n\r\n\r\n외모에 자신 없는 분들. 결점을 커버하여 예쁘게 보이고 싶은 분들.제가 다 도와드릴께요!!! 이제 매직터치 김슨생의 클래스를 기대해주세요!!!','2013-04-22 12:58:19','2014-01-13 17:32:52',5756,'Make-up Artist','Jihyun Kim','http://player.vimeo.com/video/65879719?title=0&amp;byline=0&amp;portrait=0','http://blog.naver.com/jhyame','','','');
