INSERT INTO `suggests` VALUES (16,NULL,NULL,'그럼세',NULL,'2013-02-05 23:13:34','2013-02-05 23:13:34','Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.1; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; MASM; .NET4.0C; InfoPath.2)','220.85.125.220'),(17,NULL,NULL,'첨 들어와 봤는데 인터페이스도 넘 세련되고 뷰티스타라는 아이디어도 너무 좋은 것 같아요.\r\n케이블계의 뷰티스탠다드가 겟잇뷰티라면 \r\n온라인계의 새로운 뷰티 스탠다드가 되어줄 것 같은 확실한 느낌이 드네요~\r\n저도 언젠가는 뷰티스타가 되고싶은 마음을 간직하며 자주 놀러올게요~윤미진 대표님 화이팅!!^^\r\n-장지영 올림-',NULL,'2013-02-06 06:56:29','2013-02-06 06:56:29','Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)','211.109.178.9'),(18,NULL,NULL,'gdxg',NULL,'2013-02-07 05:20:36','2013-02-07 05:20:36','Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.17 (KHTML, like Gecko) Chrome/24.0.1312.57 Safari/537.17','182.162.60.6'),(19,NULL,NULL,'',NULL,'2013-02-08 23:26:14','2013-02-08 23:26:14','Mozilla/5.0 (Linux; U; Android 4.0.4; ko-kr; IM-A770K Build/IMM76D) AppleWebKit/534.30 (KHTML, like Gecko) Version/4.0 Mobile Safari/534.30','175.223.41.8'),(20,NULL,NULL,'t',NULL,'2013-02-25 07:10:39','2013-02-25 07:10:39','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.17 (KHTML, like Gecko) Chrome/24.0.1312.57 Safari/537.17','153.161.25.221'),(21,NULL,NULL,'auraskin 유리',NULL,'2013-04-10 17:52:23','2013-04-10 17:52:23','Mozilla/5.0 (iPad; U; CPU OS 4_3_5 like Mac OS X; ko-kr) AppleWebKit/533.17.9 (KHTML, like Gecko) Version/5.0.2 Mobile/8L1 Safari/6533.18.5','59.7.21.58'),(22,NULL,NULL,'문송희',NULL,'2013-04-15 02:29:50','2013-04-15 02:29:50','Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET4.0C; .NET4.0E; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; InfoPath.2)','106.242.84.142'),(23,NULL,NULL,'송사랑',NULL,'2013-04-15 02:41:33','2013-04-15 02:41:33','Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET4.0C; .NET4.0E; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5